INSERT INTO `emeehan_blog` VALUES (1,'2006-09-05 22:45:00','2012-03-08 02:42:51',1,NULL,'Kevin Federline - VMA joke','personal',1,'','<p>\n	<strong>FEDDER</strong>&nbsp;- the action of money equals talent</p>','<p style=\"text-align: center;\">\n	<img alt=\"Kevin Federline\" class=\"aligncenter border\" height=\"400\" src=\"http://emeehan.com/wp-content/uploads/2006/09/kevin_federline300.jpg\" title=\"Kevin Federline\" width=\"300\" /></p>\n<p>\n	Okay so I don&#39;t keep up with the celebrity shit, but I know enough to know who K-Fed is. So to cut this short.. I was watching TV the other day and got a glimpse of the VMA with the grand showcase of K-Fed. This guy has no talent... what the fuck..... just goes to show that its not who you know but who you knock up.</p>\n<p>\n	I think I got a new word for this... <strong>FEDDER</strong> - the action of money equals talent</p>',1157496300,1331174571,'live','3 months','wysiwyg-advanced',NULL,'4e0f911170fe481445de658d6692a237',1,'',NULL),(2,'2006-10-01 14:41:00','2012-03-08 02:43:49',1,NULL,'Welcome to Suburbia!!','welcome-to-suburbia',1,'','<p>\n	So I now find my self in the suburbia race to quarter acre perfection.</p>','<p>\n	&nbsp;</p>\n<div>\n	Okay so just a few weeks ago I purchased my first house in a nice neighborhood in Cedar Park, just a few miles outside Austin. So stoked on not paying rent any more and having my own place.... the freedom is great. One thing I did not see coming from this whole thing is not what you would think when making such a large purchase. Sure I have the &quot;<em>can I make the payment</em>&quot; blues from time to time.. but they pass. The thing I am talking about is the suburbia life style... nice yards and perfect grass at every house on the block but mine. So I now find my self in the suburbia race to quarter acre perfection. Its crazy... never thought I would hear my self say &quot;<em>I need to water my lawn</em>&quot;... when I was a kid I wanted my parents to start a rock garden to save me the labor of mowing the lawn. Fuck what did I get my self into at 26 years old.... lol.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Must say.... suburbia has its ups and downs.... but you will never see me living in a ghetto ass apartment again... FUCK YOU Victory Drive crap wholes.... Fuck You very much....lol.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Eddie.... pissing in your yard.</div>',1159713660,1331174629,'live','3 months','wysiwyg-advanced',NULL,'9d956ae8add6f6d020cf7efec04b3306',1,'',NULL),(3,'2007-04-03 17:07:00','2012-03-08 02:44:15',1,NULL,'I must be hot sex','i-must-be-hot-sex',1,'','<p>\n	I must be hot sex because all the ladies want dez nutz!</p>','<p>\n	<img alt=\"The Cubical\" class=\"pyro-image\" src=\"/uploads/files/cubical.thumbnail_1.jpg\" style=\"width: 128px; height: 121px; \" title=\"toy cubical with box head guy working at a computer\" />Oh snap, it worked... you clicked my blog. Now don&#39;t you feel like a sucker for letting sex sell you something.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Okay okay, so this was not a test as much as it is a rant... an &quot;EDism&quot; if you will. So what the fuck is up with all the porn slinging on MySpace.... I mean I know I am hot butter on breakfast toast and all ... !cough... !cough , but come on already. I get hit with more fake friend requests and messages from girls who &quot;just found me while searching with friends and found my page interesting&quot; Makes me wonder who is on the other side of that email... I know what your thinking, some fat white guy with pedo-vision right. Well my career choice and history with marketing professionals might disturb you, the person sending you all that crap just might be wearing a suit and tie, sits in his 40th floor cubical and drinks coffee from a &quot;#1 Dad&quot; mug.</p>\n<p>\n	So feed a metric watching marketing man today, and just click where it says... &quot; Watch my live web cam&quot;.</p>\n<p>\n	This has been an EDism, and keep your fuzzy nuts off my lawn.</p>',1175620020,1331174655,'live','3 months','wysiwyg-advanced',NULL,'f2af8c3af16909550b5084b0da3fa492',1,'',NULL),(4,'2007-06-26 13:26:00','2012-03-08 02:44:49',1,NULL,'Found it!!','found-it',1,'','<p>\n	So now I have a new passion and something to get in the water for again, it might not be surfing and nothing like the beaches in Hawaii... but for me it&#39;s the release I have been looking a long time for.</p>','<p>\n	&nbsp;</p>\n<div>\n	So been living in Texas over a year now, and still don&#39;t have much of a life outside work. Sure I do the downtown thing from time to time, but that&#39;s fun in small doses. I have had a hard time finding a new past time now that I am land locked and no surf in sight. I took a trip down to the Texas coast and picked up an 11&#39; long board or the Epoxy Titanic as I like to call it. I have taken it out to the lake for a few flounder prone paddling sessions, get a lot of funny looks from the locals. Today my new stand up paddle was delivered to my door via UPS, and I ripped into the box like a fat kid on Jolt cola. Jumped in my truck and had it in the water in 10 minutes. I have to say that stand up paddling is not easy the first time, and getting my big 6&#39;7&quot; ass to balance on the board is like teaching your dog to do the dishes. After a few failed attempts I started to think I was never going to stand up, came up with a million excuses why I couldn&#39;t do it.... board is too small, it&#39;s too windy, I drink too much beer, etc. etc. In my frustration I prone paddled across the river as fast as I could, trying to build enough speed to coast for a few yards, like catching a wave I popped up and was standing. I started paddling to keep my speed... and that was it... I was stand up paddling... fucking stoked. To some this might seem like a small task, but I have not done any exercise for almost a year.. and it shows.</div>\n<div>\n	&nbsp;</div>\n<div>\n	So now I have a new passion and something to get in the water for again, it might not be surfing and nothing like the beaches in Hawaii... but for me it&#39;s the release I have been looking a long time for. Hey I found the stash... now go get me a lighter and a bag of Funyuns.</div>',1182864360,1331174689,'live','3 months','wysiwyg-advanced',NULL,'8d31b7f8a576f4e8015460b887ac2d21',1,'',NULL),(5,'2007-08-06 18:21:00','2012-03-08 02:45:07',1,NULL,'Where is Napoleon?','where-is-napoleon',1,'','<p>\n	It&#39;s cool in Europe.</p>','<p>\n	&nbsp;</p>\n<div>\n	Okay so I had this big idea about Napoleon and how he was some great leader that became emperor of France... but then I remembered a lot of people had to die for that title ... so maybe not the best metaphor. What I did want to say is I have had a hard time finding something to believe is worth working harder for... something beyond a bottom line. My job demands me to be different, but follow everyone else? I don&#39;t get it. If I am going to work hard for something, what is my motivation? Money&hellip;? Respect&hellip;? Self Satisfaction&hellip;?</div>\n<div>\n	&nbsp;</div>\n<div>\n	Hmmmm.... good question, well I would say money is a good motivator... &nbsp;the bills and student loans, it would be good to pay them on time right? So work harder and someone will notice and give me a raise? Nah... Fuck that.... find a new place that will pay you more money, problem solved.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Then what about respect, that must be a motivator right, hmmmm, do I care what others think about me? Well since I am a designer I put myself out to be seen constantly, and everyone has an opinion.... everyone. Follow the &quot;style guide&quot; and make happy 2.0 gradients tell they go out of style, problem solved.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Okay then it must be the Self Satisfaction right... I mean you most motivate yourself? Well at one point in time I did, then I felt guilty... people told me I was dirty and then the guilt thing again, so I learned to motivate myself and not tell others in fear of judgment. I learned this is just an American thing, and it&#39;s cool in Europe... so I am moving to France, problem solved.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Hey is that any way to kick a kitten ... let me show you how it&#39;s done.</div>',1186424460,1331174707,'live','3 months','wysiwyg-advanced',NULL,'f34b4cfe5bca0f6ecae1ec4cbddc276b',1,'',NULL),(6,'2007-09-04 01:23:00','2012-03-08 02:52:08',1,NULL,'The Start of a new blog','the-start-of-a-new-blog',10,'','<p>\n	Okay so this is day one of my new blog and am switching my CMS from&nbsp;ModX&nbsp;to&nbsp;WordPress.</p>','<p>\n	Okay so this is day one of my new blog and am switching my CMS from <a href=\"http://modxcms.com\">ModX</a> to <a href=\"http://wordpress.org\">WordPress</a>. I really loved ModX, but find it works better for my client sites and not a good blogging tool. Wordpress seems to have a large community behind it, so I am sure I will be spending a lot of time in the forums looking to customize my blog.... I can&#39;t have the default layout... I need my design back. Any way.... this first post is kind of point less, and only using it to remove the default content. Ohh and welcome to my site, hope you stay for dinner.</p>',1188868980,1331175128,'live','3 months','wysiwyg-advanced',NULL,'e14facb81a20d55ff78d424a3b3c27f4',1,'',NULL),(7,'2007-09-07 18:50:00','2012-03-08 02:52:32',1,NULL,'Good Times','good-times',1,'','<p>\n	Back in the day the good times were some friends and I taking a road trip to Kona/Waipio Valley in one of my many busted ass cars.</p>','<p style=\"text-align: center;\">\n	<img alt=\"beach cruiser\" class=\"pyro-image\" src=\"/uploads/files/DSCN2863.JPG\" style=\"width: 400px; height: 300px; \" /></p>\n<p>\n	You know I often think of &quot;Good Times&quot;, and what they mean to me. Back in the day the good times were some friends and I taking a road trip to Kona/Waipio Valley in one of my many busted ass cars, take you pick...</p>\n<ol>\n	<li>\n		1979 Mazda GLC wagon</li>\n	<li>\n		1986 Nissan Sentra</li>\n	<li>\n		1989 4x4 Ford Ranger (bad ass truck... it was pimp purple with flakes)</li>\n	<li>\n		or the toughest of the tough the 1987 Ford Escort.</li>\n</ol>\n<p>\n	&nbsp;</p>\n<p>\n	The Escort took the cake, because I pimped this ride out.... oh yeah... gloss black paint job, fog lights, custom island chain stencil (courtesy of PatterNuts) and a 6 speaker CD system bumping only the best tunes. Oh yeah, Kona didn&#39;t know what hit them when we rolled up on the scene.... and the damn thing might as well been four wheel drive for the roads we took it down. Like a champ, and to show true Ford craftsmanship this beast would not be stopped.... time and time again it would be put to the test; 69&#39;s, Pinetrees, and Kawa. But like all good times it came to an end when I moved away to Florida to go back to school, I heard rumors that it was still on the island... that it had been seen at the Prince Kuhio Mall parking lot, or maybe down at Richardsons... I don&#39;t remember. All I do know, is that if you ever meet someone who had the privilege of riding in the &quot;Black Bandit&quot; they will tell you that it was &quot;Good Times.... Good Times&quot;</p>\n<p>\n	Thanks for reading, and always remember .... paper bags make for good Halloween costumes in a pinch.</p>',1189191000,1331175152,'live','3 months','wysiwyg-advanced',NULL,'cec6807aa8b41ce821833065dc001086',1,'',NULL),(8,'2007-10-15 18:44:00','2012-03-08 02:52:53',1,NULL,'No do overs','no-do-overs-rant',1,'','<p>\n	I am here today, so I live today.... I can&#39;t wait for tomorrow, for all I know tomorrow might never come.</p>','<p>\n	&nbsp;</p>\n<div>\n	So its late, and I find my self once again thinking about my life and what I am doing with it. I am living it, right now and at this very moment my life is being lived by me. Fuck if I only get one shot at this life (as far as I know) so I make the most of it each and every day. Some times that little voice says &quot;What if....&quot; well I say &quot;What if I don&#39;t....&quot;. People tell me to wait and something good will come.... I can&#39;t wait, too many people wait for something to happen. I quit my last job because my Creative Director told me &quot;wait my turn&quot;, I said no.... You blew your chance. I am here today, so I live today.... I can&#39;t wait for tomorrow, for all I know tomorrow might never come. Not to say I live on the edge, what ever that means. I live in the now, and a little in the past (but I am working on that), but not much in the future. I don&#39;t ignore the possibilities with my future, I am well aware of what I can do... maybe that is why I am so stoked on the idea of what could happen next..... hmm, &quot;Happen Next&quot; just the idea behind that phrase is confusing, because we would like to think we know, and want to prepare for it.... but we are really clue less as to what &quot;next&quot; is.</div>\n<div>\n	&nbsp;</div>\n<div>\n	I was doing 70mph to Dallas passing tractors... true story.. ask JD.</div>\n<div>\n	&nbsp;</div>\n<div>\n	PS. don&#39;t mind this rant, its late and I can&#39;t sleep</div>',1192473840,1331175173,'live','3 months','wysiwyg-advanced',NULL,'758a6f76e62de2d9ea576e9107c92219',1,'',NULL),(9,'2007-11-04 17:47:00','2012-03-08 02:53:12',1,NULL,'I miss surfing!!!','i-miss-surfing',1,'','<p>\n	When I had a problem, I surfed. When I had a bad day, I surfed.</p>','<p>\n	When I had a problem, I surfed. When I had a bad day, I surfed. When everything seemed wrong in this world, I surfed. And when I got out of the water... its as if the thousands of gallons of salt water just washed all the bullshit away. Surfing (or body boarding, which was 70% of the time) was my escape from the world, it was my pain killer... my escape from the realities we call life. I could spend hours in the water, no need for food or drink. I didn&#39;t even need to make much money, or drive a fancy car, it was all about getting to the beach and just hanging out with friends. It was the few times in my life I truly felt excited, and inspired.</p>',1194198420,1331175192,'live','3 months','wysiwyg-advanced',NULL,'d227472950bcc1281e4d7a42a01e35aa',1,'',NULL),(10,'2007-11-26 18:32:00','2012-03-08 02:53:30',1,NULL,'California VS Texas - Round One','california-vs-texas-round-one',1,'','<p>\n	The two years in California I made some great friends, and may not stay in touch as much as I would like, I consider them some of the most influential people in my life.</p>','<p>\n	&nbsp;</p>\n<div>\n	Okay so the title is not 100% true... its not really about California VS Texas, but more of a comparison of the two. I have been living in Texas over 18 months now, and I lived in California just over 24 months before moving here to Texas.</div>\n<div>\n	&nbsp;</div>\n<div>\n	The two years in California I made some great friends, and may not stay in touch as much as I would like, I consider them some of the most influential people in my life. Now all you peeps in Hawaii and Florida, hold your shit.... you guys are fucking awesome too. But the people I met in California were friends I made while starting my career. All those stressful days in the office, I needed a good friend to hit up happy hour, or go have lunch with. Jen, Chris, Fabio, Lucy, Brad, lil Sis, Joe, Brian, Trish, Jill, Kristen Taki, Joel, Cole, the DJ at Garapallo, and all the people who I meet at the bars or happy hour.... lots of people for a small town like San Luis Obispo. On any given day I could call or be called to do something. Beach bon fires, house party, lazy saturday, sunday funday, etc, etc.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Flash forward to Texas, the present, the now. I was in a relationship when I moved here, and didn&#39;t go downtown very often and worked my ass to the bone for the first year. Well now I am single, and have a small group of friends that I go out with, but its not the same. Something is different here, the people are different, the attitudes are different. Maybe its because every time I go out I try and talk to people, woman mostly, and they all think I am trying to get in their pants. Well for maybe 5% of the woman I approach that might be true, but really I am just looking to make friends here. I have made a few friends by this approach, but still don&#39;t feel like people understand me. I do find I meet more people older than myself, which is great, but then sometimes find that I don&#39;t have a lot in common with them. I am still young in my career, still trying to find my place, not ready to settle down, can barely manage my responsibilities. I am 27 living in a 30 something city... where are all the 20 somethings like my self?? Lets go get a beer!!</div>',1196101920,1331175210,'live','3 months','wysiwyg-advanced',NULL,'e1f0260062c8da511c42863c4d9a7518',1,'',NULL),(12,'2008-02-09 08:25:00','2012-03-08 02:54:06',1,NULL,'Coke & SUV’s make midgets angry.','coke-suvs-make-midgets-angry',1,'','<p>\n	The little one keeps running his mouth like a strip bar disc jockey.</p>','<p>\n	So last night my friend JD and I were walking back to my car minding our biznas. We walked passed 3 trust fund (I work in the Frost Tower) guys getting into a BMW SUV. While talking to JD I over heard one of the guys call me a fagot.... WHHHHAAAAATTTT!!! did you call me? Of course I stopped, and then they proceeded to get out of there car and walk over to square us off. I am out gunned but not nearly as drunk as these fuck tards, and the bigger one comes to square with me, and the little one keeps running his mouth like a strip bar disc jockey.</p>\n<p>\n	At this point I can tell neither JD or my self had any intention of getting into a fight tonight, to be honest my night was super fun up until that point. And even tho the adrenaline started pumping... I was not nearly as amped up as I have been in past fights, I was actually very calm. To my surprise one of them had a sense of reason and proceeded to tell us his friends were just drunk and that unless we really wanted to start a fight we should just walk away. I thought about it for a moment, but felt I had been challenged and that I needed to prove something... but to who? And for what? So three drunk guys can say they started a fight over?? what? calling someone a name? I stood there for a good two minutes while Egor from the GAP was breathing hot steam down my neck waiting for me to make a move, meanwhile Napoleon from EXPRESS is still running his mouth (the little ones always do). I took a second look, the bars were a little overwhelmed with dudes tonight, and maybe these guys are just bummed they ain&#39;t getting laid tonight and the coke and roids has them all bent out of shape. I on the other hand had a great night, seen some old friends, made some new ones and talked to a number of very attractive women... I had no reason to be a hater. My life is damn good. So, we walked away. End of story.</p>',1202545500,1331175246,'live','3 months','wysiwyg-advanced',NULL,'0583f632dce025be8bbc92db93d79e22',1,'',NULL),(13,'2008-03-25 01:27:00','2012-03-08 02:54:29',1,NULL,'Most Wanted','most-wanted',1,'','<p>\n	Not to say I am satisfied with my current state, I am always making efforts to improve myself and my talents.</p>','<p>\n	So earlier this month I attended <strong>SXSW Interactive</strong> again. This was my second year in attendance, and feel I got a lot more out of it this year then last. I viewed a few panels, meet some new people, did a little networking, and of course hit up a few after parties. The Frog Party was huge, long lines at the bar and a ton of people, good times.</p>\n<p>\n	During all the mixers and after parties I noticed a common need in the industry, graphic designers are still in high demand. The senior level designers are hard to come by, most are employed and the ones that are looking don&#39;t stay unemployed long. My company was looking for junior level designers and we had a hard time filling the position. Any time I mentioned I was a designer some recruiter or project manager would swoop in and hand me a card. Felt good to be wanted, and after seeing some of the resumes for our designer position I know I am still kicking ass. Not to say I am satisfied with my current state, I am always making efforts to improve myself and my talents.</p>\n<p>\n	Note to self - <em>Keep busting out ideas for new projects, and one day it will all be worth it.</em></p>',1206408420,1331175269,'live','3 months','wysiwyg-advanced',NULL,'a81552fe6e7c0e7b53568d77185bb27c',1,'',NULL),(14,'2008-04-20 16:43:00','2012-03-08 02:54:49',1,NULL,'I’m breaking up with you!','im-breaking-up-with-you',1,'','<p>\n	It&#39;s over, I&#39;m breaking up with you Down Town Austin (West 6th, Dirty 6th, 4th &amp;amp; Warehouse).</p>','<p style=\"text-align: center;\">\n	<img alt=\"Union Park Girls\" class=\"pyro-image\" src=\"/uploads/files/Edward-and-the-Girls.jpg\" style=\"width: 450px; height: 294px; \" title=\"Edward and the smile girls\" /></p>\n<p>\n	So I have been thinking about this for some time now... and this is really hard for me, trust me. I know how much fun we have together, all those long nights and crazy randevu&#39;s. We both know your not good for me, a bad influence at my weakest point. Let&#39;s just be friends, I still want to see you.... just not all the time, and not like before, it needs to be different, I need to move on. I am not the same person I was 9 months ago, but you won&#39;t let me grow, and it&#39;s time I cut this relationship off.</p>\n<p>\n	It&#39;s over, I&#39;m breaking up with you Down Town Austin (West 6th, Dirty 6th, 4th &amp; Warehouse).</p>',1208709780,1331175289,'live','3 months','wysiwyg-advanced',NULL,'3de01e972c600deb93e587570b4ae376',1,'',NULL),(15,'2008-05-01 03:22:00','2012-03-08 02:55:13',1,NULL,'Tornado Warning!','tornado-warning',1,'','<p>\n	So this Friday night was my first real tornado watch here in Texas.</p>','<p>\n	So this Friday night was my first real tornado watch here in Texas. Was a little paranoid but also a little excited, have always wanted to see a tornado in real life. I sat on my back porch looking for funnel clouds, but it was getting dark and the storm started producing some heavy lightning. I decided that sitting in the backyard was probably not the smartest idea and decided to take safety indoors. I needed a safe lightning viewing position so I opened my garage picked up my old Nikon digital camera and snapped a few photos. Was really stoked on the quality of some of these shots... wanted to share them with all of you.</p>\n<p>\n	View the rest of the images on my <a href=\"http://picasaweb.google.com/meehan2015/LightingStrikes#\" target=\"_blank\" title=\"View lightning images on my Picasa Album\">Picasa Gallery</a>.</p>\n<p style=\"text-align:center\">\n	<embed flashvars=\"host=picasaweb.google.com&amp;hl=en_US&amp;feat=flashalbum&amp;RGB=0x000000&amp;feed=https%3A%2F%2Fpicasaweb.google.com%2Fdata%2Ffeed%2Fapi%2Fuser%2Fedward.meehan.808%2Falbumid%2F5195303233711141329%3Falt%3Drss%26kind%3Dphoto%26hl%3Den_US\" height=\"400\" pluginspage=\"http://www.macromedia.com/go/getflashplayer\" src=\"https://picasaweb.google.com/s/c/bin/slideshow.swf\" type=\"application/x-shockwave-flash\" width=\"600\"></embed></p>',1209612120,1331175313,'live','3 months','wysiwyg-advanced',NULL,'80725bee5946e57371b4923548de1b15',1,'',NULL),(16,'2008-05-06 02:36:00','2012-03-08 02:55:32',1,NULL,'Life in 20 something.','life-in-20-something',1,'','<p>\n	Well it&#39;s late, and I always seem to reflect on my past at 1am sitting in my office.</p>','<p>\n	Well it&#39;s late, and I always seem to reflect on my past at 1am sitting in my office. Did what I always do, started looking at old photos, thinking of other moments in my life. Have to say I have been really fortunate. Have had many people come and go, but always seems that I pick the good ones to stick around. I am very stoked on the path my life has taken. I am happy, but also very lost... someone told me I&#39;m going thru a &quot;Quarter Life Crises&quot;, could be true.</p>\n<p>\n	I am way too busy! Yet I never feel as if I get a whole lot done, but things are being done... just not as efficiently as I would like. Here is a simple breakdown of my day:</p>\n<ul>\n	<li>\n		<em>7:30 to 8:40 AM</em> - Wake up, get dressed, have a quick bite to eat and head out the door.</li>\n	<li>\n		<em>8:40 to 9:20 AM</em> - Fight morning traffic to work (Thank goodness my LS is fun to drive).</li>\n	<li>\n		<em>9:20 to 11:30 AM</em> - Attempt to get some work done, but mostly check e-mails and tighten up loose ends and daily tasks.</li>\n	<li>\n		<em>11:30 to 12:30 PM</em> - Take a lunch break (but not always an option, depending on my work load)</li>\n	<li>\n		<em>12:30 to 5:30-7:30 PM</em> - This is when I get most my work done, and working on my 3rd cup of coffee.</li>\n	<li>\n		<em>6:00 to 7:00 PM</em> - Drive home, stop and pick up some food, gas, etc.</li>\n	<li>\n		<em>7:00 to 8:30 PM</em> - Make dinner and just try to decompress from the day.</li>\n	<li>\n		<em>8:30 to 10 PM</em> - This is a foggy area, sometimes I do yard work when I get home so I might not eat dinner until 9PM.</li>\n	<li>\n		<em>10:00 to 11:00 PM</em> - Go to 24 Hour Fitness, or go running. I switch every other day.</li>\n	<li>\n		<em>11:00 to 12:30 AM</em> - Attempt to get some work done (but mostly spazz out and look at old photos).</li>\n</ul>\n<p>\n	&nbsp;</p>\n<p>\n	And that is a typical work day. Sometimes I do a happy hour, or something will come up that changes my time around, but pretty simple. My weekends fly by even faster, before I know it... back to work on Monday. When I break down my times I really could be more efficient and make time for other activities, but where do I start? I want more time to hang out with friend (or make more at this moment). I would like to spend more time doing some outdoor activities, like stand up paddling again... that will kill at least an hour on the lake each day. Let&#39;s not forget that I am single and dating too, where do I fit that time in? Ahhhhrggg! Man, I need surfing again, thats when time just stands still.</p>',1210041360,1331175332,'live','3 months','wysiwyg-advanced',NULL,'510f018ddcc22b5205e8665b8d87815e',1,'',NULL),(17,'2008-09-04 03:12:00','2012-03-08 02:55:51',1,NULL,'Faces and HipHop!','faces-and-hiphop',1,'','<p>\n	WOW, am I growing up, or am I still that kid I was 8 years ago?</p>','<p style=\"text-align:center\">\n	<img alt=\"my_many_faces.jpg\" class=\"pyro-image\" src=\"/uploads/files/my_many_faces.jpg\" style=\"width: 500px; height: 150px; \" /></p>\n<p>\n	So it&#39;s late again, well almost 2am... and I am up in my home office backing up old photos and getting ready to move into my apartment. I have been having one of those self reflection weeks again, damn seems I&#39;m having a lot of them lately. Well mostly because I am bored again, and need an outlet. Thinking I might start playing paintball again to let off some steam. Well this post was started after looking at all the photos of myself over the years and how I have aged, and I don&#39;t feel like I look that much different over the last 8 years. The photo above starts when I was 20 years old (far left) and moves all the way to recent (far right). WOW, am I growing up... or am I still that kid I was 8 years ago? I sometimes can&#39;t tell the difference, physically and mentally. Ha, if anything I have more responsibility now... a lot more. Have a mortgage, student loans, credit card, and car loans to pay these days... money money money. Damn, think this turned into a money rant, well its late and I am really sleepy.</p>\n<p>\n	Listening to some dope hip hop... I sometimes wish I could just stream music straight into my head 24/7 to block the noise outside. I found a new iTunes station that has been playing some of the best beats I have heard. The station is in the HipHop category or you can visit the website at <strong><a href=\"http://truehiphop.fm/\" title=\"visit TrueHipHop.fm\">TrueHipHop.fm</a></strong> for more information. Def worth the time to check it out, it has made my days fly by.</p>\n<p>\n	Okay well I always close my post with some stupid comment or Ed-ism so let&#39;s see how you like this one.</p>\n<blockquote>\n	<em>Don&#39;t find someone you can live with, find someone who you can&#39;t live without ... and if they don&#39;t want you just keep drinking, because there are plenty of fish in the sea... but if they can&#39;t swim away then you can just club them on the head.</em></blockquote>',1220497920,1331175351,'live','3 months','wysiwyg-advanced',NULL,'83fb364602e01cffb1c896e9b4e49688',1,'',NULL),(18,'2008-09-08 10:32:00','2012-03-08 02:56:14',1,NULL,'West Six','west-six',1,'','<p>\n	I know I was wrong to leave you. You may not be right for me but you&rsquo;re always true to me.</p>','<p style=\"text-align:center\">\n	<img alt=\"union_fun.jpg\" class=\"pyro-image\" src=\"/uploads/files/union_fun.jpg\" style=\"width: 329px; height: 338px; \" /></p>\n<p>\n	I know I was wrong to leave you. You may not be right for me but you&rsquo;re always true to me. All this time away gave me the strength to say I was over you&hellip; but I cracked and came back&hellip; and it was good! So I will stop fighting my true nature, I am what I am, you and I are one in the same. So what if you have used countless hundreds like me every night, but when I am with you, I feel as if I am the only one. So lie to me again, cheat on me again, and make me feel like you care just one more time. Take me back <strong>West Sixth</strong>, I&rsquo;m going to make 2009 a year to remember, <em>trust me</em> !</p>',1220869920,1331175374,'live','3 months','wysiwyg-advanced',NULL,'b571d5ee31d875dbf32f2c2b3138a4c8',1,'',NULL),(19,'2008-09-09 02:39:00','2012-03-08 02:56:32',1,NULL,'Don\'t be so negative!','dont-be-so-negative',1,'','<p>\n	I came upon a small bag of old negatives that I must have grabbed from Hawaii a few years ago.</p>','<p>\n	Such a random thing happened tonight while packing boxes to get ready for my move next week. I came upon a small bag of old negatives that I must have grabbed from Hawaii a few years ago. I don&#39;t know why or how I have these but some of the images I figured were lost forever, what a sweet find. Man this pictures are from way back in the day, like back in 97 when I was all into under water photography. Man, almost makes me a little bummed I didn&#39;t pursue it more. Well its never to late, and I would love to have an excuse to start some surf travels again. Man I am at that age now where I need to do it up and not forget my past, damn those days at the beach were the best days ever.</p>\n<p style=\"text-align:center\">\n	{pyro:galleries:images slug=&quot;dont-be-so-negative&quot;} <a href=\"/galleries/{gallery_slug}/{gallery_file_id}\"> <img alt=\"{description}\" src=\"/files/thumb/{file_id}\" title=\"{title}\" /> </a>{/pyro:galleries:images}</p>',1220927940,1331175392,'live','3 months','wysiwyg-advanced',NULL,'1fbde1d165454e614c09d4ea84c63fe1',1,'',NULL),(20,'2008-09-24 01:32:00','2012-03-08 02:56:48',1,NULL,'Family Ties','family-ties',1,'','<p>\n	She give me solid advice, and damn is it good.</p>','<p style=\"text-align:center\">\n	<img alt=\"DSC00005.JPG\" class=\"pyro-image\" src=\"/uploads/files/DSC00005.JPG\" style=\"width: 400px; height: 300px; \" /></p>\n<p>\n	Wow, so I just got off the phone with my little sister, well my big sister now... because she is giving me advice these days. Love her, she is the best things to come into my life. As a child she stole the spot light, and I had issues with that. As I grew up and we bonded, my brat little sister became my best friend. No matter what she is always there for me, and I will never forget that. As her big brother I have done what I could to push her in the right direction. When she wanted to take a break from school and live at home I invited her to live with me in San Luis Obispo, California while I interned with a surf company. My logic was to get her out of Hawaii, show her there was more out there than just the islands and explore. Seemed to work, she went back to school and is now living in San Fransisco with her boyfriend of two years.</p>\n<p>\n	Now the tides have turned, and I look to my sister for advice. She has grown up so much its funny to me, she is still that little girl to me sometimes, the one who would tell my mom when I said &quot;fuck&quot; or &quot;shit&quot;. She would always get me in trouble, I remember the time she found my stash and gave it to my parents, those were fun days. Now she give me solid advice, and damn is it good. It&#39;s like having my own Dr. Phil but with out the stupid puns or witty comments.</p>\n<p>\n	I have learned alot about my self, and only becuase I can look at myself thru someone elses eyes. Get advice from a person who really cares about me, who really loves me. In this trully lonley world, I can still find comfort in a phone call, just to hear her voice has made all the difference to me tonight. Thank you Rosey, you are and will always be my big little sister.</p>',1222219920,1331175408,'live','3 months','wysiwyg-advanced',NULL,'47b53bea278845f8a02de93e19fd8a17',1,'',NULL),(21,'2008-09-27 13:01:00','2012-03-08 02:57:52',1,NULL,'Flyin Hawaiian','flyin-hawaiian',1,'','<p>\n	Thought I would post a few pictures from the company boat trip this last Thursday. Everyone had a good time, lots of food, beer, and perfect weather.</p>','<p>\n	Thought I would post a few pictures from the company boat trip this last Thursday. Everyone had a good time, lots of food, beer, and perfect weather.</p>\n<p style=\"text-align:center\">\n	<embed flashvars=\"host=picasaweb.google.com&amp;captions=1&amp;hl=en_US&amp;feat=flashalbum&amp;RGB=0x000000&amp;feed=https%3A%2F%2Fpicasaweb.google.com%2Fdata%2Ffeed%2Fapi%2Fuser%2Fedward.meehan.808%2Falbumid%2F5600583500305173073%3Falt%3Drss%26kind%3Dphoto%26authkey%3DGv1sRgCPSFreqz2OTZ5AE%26hl%3Den_US\" height=\"400\" pluginspage=\"http://www.macromedia.com/go/getflashplayer\" src=\"https://picasaweb.google.com/s/c/bin/slideshow.swf\" type=\"application/x-shockwave-flash\" width=\"600\"></embed></p>',1222520460,1331175472,'live','3 months','wysiwyg-advanced',NULL,'56a92a393940117a4a243f5905d94f43',1,'',NULL),(22,'2008-10-01 23:35:00','2012-03-08 02:58:34',1,NULL,'The 100 Mile Challenge','the-100-mile-challenge',1,'','<p>\n	I decided that it was time I kicked my running up a notch.</p>','<p>\n	I decided that it was time I kicked my running up a notch. I have been running about 2 to 3 times a week for the last year. When I started back in October of 2007 I was running about 2 miles. The last few months I have started doing 4 miles. I recently found a <a href=\"http://www.mapmyrun.com/user/united-states/tx/austin/emeehan\" target=\"_blank\" title=\"Edward\'s MayMyRun Profile\">website</a> that tracks your routes and times, lets you set up goals and tracks them. Its a pretty handy site, and I think I am going to enjoy following my progress. I have already entered 2 of my routes on Town Lake (Lady Bird Lake), Austin TX. On a side note, my new route that I ran with my friend Rob nearly kicked my ass, he is in better shape than I and it was a good motivator just trying to keep pace.</p>\n<p>\n	Any way, the point of this post is I have started a 100 mile challenge today. I am going to run 100 miles in 30 days. I have always tried to set physical goals for myself, but always seem to cut them short or fall off the plan. I have challenged other areas of my life, and have broke wall after wall. Running has started to become my replacement for surfing. I get excited after work with the thought of running town lake. I load my iPod with any track that has a heavy beat to help me keep pace. Don&#39;t laugh but techno seems to help, well Drum n Bass, or what ever the music geeks call it.</p>\n<p>\n	So please check my progress, and keep me on track. I will need the motivation of my friends and family to keep me running. I need this to set a bar, something I can shoot for.</p>\n<ul>\n	<li>\n		<a href=\"http://mapmyrun.com\" target=\"_blank\" title=\"visit mapmyrun.com website\">MapMyRun.com</a></li>\n	<li>\n		<a href=\"http://www.mapmyrun.com/user/united-states/tx/austin/emeehan\" target=\"_blank\" title=\"view my mapmyrun.com profile\">My Profile</a></li>\n	<li>\n		<a href=\"http://www.mapmyrun.com/user_training?u=604860634738\" target=\"_blank\" title=\"view my mapmyrun.com training log\">View my training log</a></li>\n</ul>',1222904100,1331175514,'live','3 months','wysiwyg-advanced',NULL,'7675af0e6f86783bf708cfe7a67cec0a',1,'',NULL),(23,'2009-03-12 02:21:00','2012-03-08 02:59:00',1,NULL,'Moments before SXSW 2009','moments-before-sxsw-2009',1,'','<p>\n	SXSW is my one chance to meet some of these creators of WOW</p>','<p>\n	<img alt=\"SXSW 2009\" class=\"pyro-image\" src=\"/uploads/files/sxsw2009ia-150x150.gif\" style=\"width: 150px; height: 150px; \" />Well it&#39;s here again, the week of all weeks for geeks around the globe to come together and share in Austin, TX. Another year has passed, and so fast. Did I learn anything from last year? Did I take home any inspiration? I think I did, but it wasn&#39;t in the panels or the trade show. It was the large masses of people, geeks like me, but better.</p>\n<p>\n	In my daily tasks I am alone in my inspiration, constantly searching the inter-web for little sparkles of greatness. I see all these great designs, but they don&#39;t speak to me, yet I know what they are saying. I look beyond the &quot;wow&quot; and ask &quot;how&quot;, and SXSW is my one chance to meet some of these creators of WOW. So many great minds, so many people who think like me, yet none of us are the same.</p>\n<p>\n	Being different is really what makes us great, but having a common interest is what brings us together... and that is what the internet is all about.</p>',1236824460,1331175540,'live','3 months','wysiwyg-advanced',NULL,'6a85f6eea4266f4952f9f21289da6cd5',1,'',NULL),(24,'2009-03-13 02:55:00','2012-07-26 06:18:57',1,NULL,'Paddle into it!','paddle-into-it',1,'','<p>\n	Just my attempt at creative writing from the perspective of surfing.</p>','<p style=\"text-align:center\">\n	<img alt=\"Paddle into it\" class=\"pyro-image alignment-none\" src=\"{{ url:site }}files/thumb/22/0\" /></p>\n<p>\n	Sitting on the beach, stretching, watching, looking for rip currents and set sizes. Looks good, think I will paddle out. Small burst of excitement as I walk towards the water, and the chill of the cold as I first make contact with the ocean. Walk my board past the inside breakers... its deep enough now, think I can paddle out. Wait for the right moment to jump on my board and start the battle against the sea, no sets in sight, let\'s go.</p>\n<p>\n	The first time the water hits my face it stings of cold, but then numb, then warm shortly after. First couple of inside waves hit me head on, they are small and I duck them with no problem. A few more paddles and I pass my first wave without duck diving, it\'s an easy paddle to the outside from here.</p>\n<p>\n	Ahhh... relax. Sit up on my board and just take in the calm of the ocean. So smooth, not a ripple in sight... man I have not seen it this glassy in weeks. Look back at the beach to check my position, looks like the current is not as strong as I thought. I see a small set on the horizon, act like I don\'t see it and maybe the others won\'t notice.</p>\n<p>\n	Slowly paddle outside, but try not to make a scene. The lines are getting closer.&nbsp; Yeah... that\'s definitely a set coming, how big are they? Okay, shit I think I am too far inside, I don\'t know where the sets are breaking, I notice others paddling out past me... maybe I should follow suit. Oh crap, that\'s a big set, small panic, butterflies, paddle your fucking ass off, and get over this first wave!</p>\n<p>\n	It\'s a wall, it casts its own shadow... the off shore breeze blows over the forming lip. The gentle lift as I start to paddle over, look down the line to see the lip form, like a cover of Surfer Magazine... this wave is beautiful, yet ugly all at the same time.</p>\n<p>\n	Looking back the spray off the lips smacks my face, and just for a moment it stops time.</p>\n<p>\n	Oh Shit!! Panic! There is another set wave, and this one is bigger!! Paddle! Paddle now, and paddle fast! I think I can catch this one, only if I can just get a little further. I turn now, as if I changed my mind, but I know exactly what I want... this wave is mine!</p>\n<p>\n	It\'s big enough and steep enough that I don\'t need to paddle hard to catch it, she catches me. The drop is steep, big bottom turn.. get into the pocket and just maybe I will get a little barrel action. I get my few seconds of adrenaline (they feel like minutes) and pull out the back.... Man that was Fucking awesome. Let\'s do it again.</p>',1236912900,1343283537,'live','3 months','wysiwyg-advanced','','54ba042203e39c24a97a52e2c53d7d36',1,'',NULL),(25,'2009-06-10 03:07:00','2012-03-08 02:59:30',1,NULL,'Ghost on Town Lake','ghost-on-town-lake',1,'','<p>\n	&nbsp;A very good friend of mine from high school, who transplanted to Hawaii from Northern Canada, and ran into some trouble in his life along the way.</p>','<p>\n	Was doing my normal run on town lake the other day, on a normal late after noon. I was passing one of the small bridges when I noticed a guy standing just below it. The man looked like a transient, but my mind locked onto the image of an old friend. A very good friend of mine from high school, who transplanted to Hawaii from Northern Canada, and ran into some trouble in his life along the way. Its been years since I have seen him, but last I was told he may not even be among us any longer. This man brought back his memeory with a rush of overwhelming emotion. I don&#39;t fully understand what it did to me, but it was if I wanted to laugh and cry all at the same time. I almost wanted to stop and go back to see if it was him.</p>\n<p>\n	I want to never forget friends like him, seems the older I get the harder it is to make those kind of friends. He was a great artist, and I have been thinking of adding a new tattoo, think his art work would be a great way to never forget.</p>',1244603220,1331175570,'live','3 months','wysiwyg-advanced',NULL,'4e5aee16477d5088cd1311c8bf8aebfe',1,'',NULL),(26,'2010-01-03 03:41:00','2013-02-25 22:21:43',1,NULL,'Wrapping up 2009!','wrapping-up-2009',1,'','<p>\n	I do have a few things I want to get off my chest, just so I don’t have to talk about them again in 2010.</p>','<p>\n	Well it’s here, a new year and a new opportunity for a fresh start. 2009 seemed to pass by without my knowledge, yet so much has happened. I started this post with the idea of doing a review of 2009, but looking back is harder then it seems. I guess I was just having too much fun, or was I trying to forget something. The past 2 years of life lessons in Austin have been great, made some good friends and some unforgettable weekends. With all the excitement I forgot my golden rule of moderation, and I have the debt and empty bank accounts to prove it. Ha, but I don’t regret any of it, what is money if not to be spent.</p>\n<p>\n	I do have a few things I want to get off my chest, just so I don’t have to talk about them again in 2010. I have met some cowards in the past few months that remind me we should always be respectful of people regardless of how important you think you are. The first coward is a business owner I met while interviewing in Austin. This guy talked a lot of game, had me do a phone interview, worked on some test files (aka free work), and then called me in for a face to face. I come into the office with my game face and ready to talk shop, I was polite, well dressed and on time. The interview went well, lasted over 2 hours and I talked with everyone in the company, all 3 of them (small web firm). I walked out with confidence I had made a good impression. I followed up 2 days later with a thank you email and “looking forward to hearing your decision” which they replied too. Well another week passed and I got no word, so I sent my final email, another short thank you and “looking forward to hearing your decision”, this time no reply. Months later and I have a new job in San Diego now, still no reply. Now I could understand not replying to a resume, or a phone interview, but an in person interview and not giving the person the courtesy of an email or a phone call… very unprofessional. So here small web firm coward, let me write my “not interested” email for you.</p>\n<blockquote>\n	Dear Edward,\n	<p>\n		Thank you for your interest in our company, but we regret to inform you that we decided not to select you for this position. We want to thank you again for your time and the best of luck on your job search.</p>\n	Thank you, John Coward</blockquote>\n<p>\n	Now was that so hard? Well seemed he could not muster up the words, was almost comparable to getting a text message break up, or the ever hilarious Facebook relationship status change. Guess with all the texting and emails, we forgot how to be people and talk face to face.</p>\n<p>\n	The second coward, well I wanted to go into detail, but decided it would be best to just take a lesson from him and not go on a rant.</p>\n<p>\n	Well all that crap aside and I am now in San Diego, working for a startup news blog. I am looking forward to what new challenges should come with my new position, and hope to take with me what I have learned from all the talented people I have had the pleasure of working with. So let’s rock this 2010.</p>',1262490060,1361830903,'draft','3 months','wysiwyg-advanced','','98e600908ad66e8fe93b5427745f3266',1,'',NULL),(27,'2010-01-16 21:24:00','2012-05-08 05:02:31',1,NULL,'Text Message Chain Mail','text-message-chain-mail',1,'','<p>\n	Take a picture of whatever is in front of you and send it to me then forward this message and see what random things you would receive</p>','<p>\n	So the other day I got a text message from my friend Joel, it said:</p>\n<blockquote>\n	Take a picture of whatever is in front of you and send it to me then forward this message and see what random things you would receive</blockquote>\n<p>\n	I normally don&#39;t participate in these kind of things, but media and social networking has peaked my interest in the past few years and I had to see if this would work. I sent them message out to about 30 people and 17 people responded. Thought it would be fun to post the images here on my blog and then blast this back out to everyone so they could see what people sent. This was actually a cool chain mail, and it was a good excuse to catch up with some friends that I have neglected for a while.</p>\n<p style=\"text-align:center\">\n{{galleries:images slug=&quot;text-message-chain-mail&quot;}} <a href=\"/galleries/{{gallery_slug}}/{{gallery_file_id}}\"> <img alt=\"{{description}}\" src=\"/files/thumb/{{file_id}}\" title=\"{{title}}\" /> </a>{{/galleries:images}}</p>\n<p>\n	It was pretty cool to see what everyone is doing, I might try to do something similar or maybe and scavenger hunt.</p>',1263677040,1336453351,'live','3 months','wysiwyg-advanced','','dc4e81c36cb55abe79a3cd17bc95c645',1,'',NULL),(28,'2010-04-08 01:45:00','2012-05-08 05:00:29',1,NULL,'Thoughts from the Laundromat','thoughts-from-the-laundromat',1,'','<p>\n	So this is my first post from my Android MyTouch, guess I need to start staying current. 2010 is still being difficult, but some recent activity has got me active brain going again.</p>','<p style=\"text-align: center; \">\n	<img alt=\"Del Mar laundromat\" class=\"pyro-image\" src=\"/files/thumb/4/400\" style=\"width: 400px; height: 300px; \" /></p>\n<p>\n	So this is my first post from my Android MyTouch, guess I need to start staying current. 2010 is still being difficult, but some recent activity has got me active brain going again. I am working a full time job, plus I picked up an additional 15+ hours a week as a contract developer for a start-up. My freelance has been neglected the past few years, been to busy trying to make a social life and not lock myself away in a room writing code. Tomorrow is going to be my first day as a tourist in San Diego, going to the Zoo. Kind of excited to see all the animals, maybe snap some pics with my cellular. Ugh, sitting here at the Laundromat is depressing, 21 minutes left on my dryer. Well this was a meaningless update, but oh well.</p>',1270691100,1336453229,'live','3 months','wysiwyg-advanced','','c2bbe02f3f7471be37c94619b1c3b911',1,'',NULL),(30,'2010-09-18 11:24:00','2012-03-08 03:01:04',1,NULL,'QIK Live Video Channel','qik-live-video-channel',1,'','<p>\n	Qik live video channel.</p>','<p style=\"text-align:center\">\n	<object classid=\"clsid:d27cdb6e-ae6d-11cf-96b8-444553540000\" codebase=\"http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0\" height=\"319\" id=\"qikPlayer\" width=\"425\"><param name=\"align\" value=\"middle\" /><param name=\"allowScriptAccess\" value=\"sameDomain\" /><param name=\"allowFullScreen\" value=\"true\" /><param name=\"quality\" value=\"high\" /><param name=\"bgcolor\" value=\"#000000\" /><param name=\"FlashVars\" value=\"username=edmeehan\" /><param name=\"src\" value=\"http://assets1.qik.com/swfs/qikPlayer5.swf?1284796240\" /><param name=\"name\" value=\"qikPlayer\" /><param name=\"flashvars\" value=\"username=edmeehan\" /><param name=\"allowfullscreen\" value=\"true\" /><embed align=\"middle\" allowfullscreen=\"true\" allowscriptaccess=\"sameDomain\" bgcolor=\"#000000\" flashvars=\"username=edmeehan\" height=\"319\" id=\"qikPlayer\" name=\"qikPlayer\" quality=\"high\" src=\"http://assets1.qik.com/swfs/qikPlayer5.swf?1284796240\" type=\"application/x-shockwave-flash\" width=\"425\"></embed></object></p>\n<p>\n	Have had this Qik account for some time now but wanted to add the live video channel to my blog.</p>',1284809040,1331175664,'live','3 months','wysiwyg-advanced',NULL,'78b1b07231b9c9a25794eccfae8aacb9',1,'',NULL),(31,'2012-05-08 05:05:00','2012-05-08 07:50:32',1,NULL,'Patio Surf Rack Build','patio-surf-rack-build',1,'','<p>\n	I built a sweet rack for my surfboards this weekend. Going to do a little DIY walk through and instruction for the interwebs.</p>','<p>\n	<img alt=\"surf rack with 2 boards\" class=\"pyro-image left\" src=\"{{ url:site }}files/thumb/38/300\" /></p>\n<p>\n	I built a new surf rack to hold my boards, only took a few hours and around $60 in materials. I picked up the supplies from Home Depot, but I am sure you can find these items at any home supply store.</p>\n<h4>\n	Supply List</h4>\n<ul>\n	<li>\n		3&quot; #8 Wood screws - &nbsp;x6</li>\n	<li>\n		1&quot; #8&nbsp;Washers - x6</li>\n	<li>\n		2&quot; #8&nbsp;Wood screws - x16</li>\n	<li>\n		1.5&quot; #8&nbsp;Wood screws - x18</li>\n	<li>\n		small caster wheels - x4</li>\n	<li>\n		0.5&quot; #8&nbsp;Wood screws - x8</li>\n	<li>\n		1&quot;x4&quot;-4&#39; Common board - x3</li>\n	<li>\n		2&quot;x3&quot;-37&quot; Board - x2</li>\n	<li>\n		2&quot;x3&quot;-20&quot; Board - x2</li>\n	<li>\n		40&quot;x20&quot; Plywood Sheet</li>\n	<li>\n		1&quot;-18&quot; Wood dowels - x6</li>\n</ul>\n<h4>\n	Tool List</h4>\n<ul>\n	<li>\n		Wood glue</li>\n	<li>\n		Speed square</li>\n	<li>\n		Pencil</li>\n	<li>\n		Measuring tape</li>\n	<li>\n		Power drill</li>\n	<li>\n		Drill bit (smaller than #8)</li>\n	<li>\n		Saw (Power, but hand will do)</li>\n</ul>\n<h4>\n	Assembly</h4>\n<p>\n	<img alt=\"scan-doc130.jpg\" class=\"pyro-image left\" src=\"{{ url:site }}files/thumb/41/300\" />To get started we need to build the base. It is a good idea to drill pilot holes first before setting screws to avoid splitting the wood. Get your ply wood sheet and your 4 sections of 2&quot;x3&quot;, assemble the frame so the outer dimensions match the plywood. Set one 2&quot; screw on each corner of the frame with a spot of wood glue at the joint. Make sure the 20&quot; 2x3 caps the end of the frame. Use your plywood to make the base square. Do this by first laying down a layer of wood glue on the joining surface of the plywood, then lay it on top the frame and secure it with one 1.5&quot; screw. Align the plywood at the furthest corner and set another 1.5&quot; screw. Finish setting the screws along the plywood by adding 8 more 1.5&quot; screws along the edge of the frame, I ran 4 screws along the 40&quot; edge and then set one in the middle of the 20&quot; edge. To finish it off you should add 4 more 2&quot; screws to each corner of the 2&quot;x3&quot; frame. Your now done with your base, this is a good time to grab a beer and take a moment relax.</p>\n<p>\n	Your base should look something like this now:<img alt=\"IMAG0170.jpg\" class=\"pyro-image\" src=\"{{ url:site }}files/thumb/34/300\" style=\"float: none;\" /></p>\n<p>\n	Now that your done with your beer it is time to do the detail work. Cut one of your 1x4 boards at 40&quot;. With your measuring tape and pencil set a mark every 10&quot; on the board and also 0.5&quot; on each side. Now run your speed square and cross each mark at 1.75&quot; and drill a hole at each mark. Set a 1&quot; washer on one of the 3&quot; screws, screw it into a pilot hole until about 0.5&quot; come out on the other side. Now get one of the 1&quot; wooden dowels and drill a small pilot hole in the center, about 1&quot; deep or so. Make sure you drill straight, since the screw is going to follow this path and you don&#39;t want it poke out the side. Set a small spot of wood glue on the pilot hole of the dowel and hand crank it onto the exposed screw tip until it is snug against the board. Now hold the dowel firmly and slowly set the screw snug with the drill. It just needs to be snug, not that tight, the washer and glue will hold it firmly in place. Now do this same procedure to the other 5 dowels. When you have finished you should sit down for another beer, the hard part is over.</p>\n<p>\n	Marking and setting the dowels.<img alt=\"IMAG0172.jpg\" class=\"pyro-image\" src=\"{{ url:site }}files/thumb/35/300\" style=\"float: none;\" /><img alt=\"IMAG0173.jpg\" class=\"pyro-image\" src=\"{{ url:site }}files/thumb/37/300\" style=\"float: none;\" /></p>\n<p>\n	Now the final bit of assembly, this might be easy with a second person, or if you have a clamp it will help as well. We need to set the two uprights that will hold our dowels and complete our rack. Measure a line 4&quot; on both sides of the 40&quot; edge of the base. Set one of your 1x4 boards vertical to the line and perpendicular to the base. Pencil a mark on the 1x4 along the top edge of the base add the letter &quot;B&quot; for bottom, then flip and measure a line 3.5&quot; from the opposite end. Now drill 4 pilot holes in a square pattern inside these marks on both ends. Now do the same thing to the other 1x4. You should have 2 boards with 8 holes each, 4 on either side. Now comes the fun part, this might take a second hand or a clamp as I said before. Also we want to make sure that we are square when we attach the dowels to the uprights. First put a spot of glue on the &quot;B&quot; end of one of your 1x4 boards and place it inside your 4&quot; line on the base. Set it with one of your 2&quot; screws, but not tight, just snug. Now do the same to the other side with the remaining 1x4. Now on the back of your 1x4 with the attached dowels you will need to make a mark at 4&quot; on both sides. Put a spot of glue inside of both marks and have someone hold it against the uprights or use clamps to secure it. Set one 1.5&quot; screw on both sides, not tight, just snug. Now that the dowels are attached to the uprights you need to make sure it is square before you finish securing it. Pull out your trusty measuring tape and measure from corner to corner, just like you would measure a TV. Now measure the opposite corners, if the measurement is the same... your square, if not you need to make an adjustment. Remember small adjustments go a long way, and you&#39;re not building a rocket. When you know your square finish adding your screws, 6 2&quot; screws along the bottom and 6 1.5&quot; screws along the top. Be sure to not set the 1.5&quot; screws to deep, or they will come out the other side and possible scratch your board.</p>\n<p>\n	That&#39;s it, now all you need to do is attach the caster wheels and give it a coat of paint to protect it. Add your boards and admire your handy work... with another beer of course.<img alt=\"IMAG0175.jpg\" class=\"pyro-image\" src=\"{{ url:site }}files/thumb/39/300\" style=\"float: none;\" /></p>\n<h4>\n	Additional Options</h4>\n<p>\n	Since my boards are wider than most I added small loop eyes to the end of the dowels and use small bungee cords to keep my boards in place. I also added a non-slip mat to the base to keep the boards from sliding on the wood. Another addition is adding pipe insulation to the dowels to add another layer of protection for your boards.<img alt=\"IMAG0187.jpg\" class=\"pyro-image\" src=\"{{ url:site }}files/thumb/40/300\" style=\"float: none;\" /></p>',1336453500,1336463432,'live','3 months','wysiwyg-advanced','','8e33b25d50a81e27a8617d96dd200dac',1,'',NULL),(33,'2012-07-26 06:25:00','2012-07-26 06:45:25',1,NULL,'Whiplash Parallax','whiplash-parallax',11,'','Parallax seems to be all over the web these days. I wanted to create a custom script with simple effects and share it on github.','<p>\n	Parallax is all over the web, and like other web trends it was born in the gaming industry. The basic idea is simple, move 2D objects across the screen to create a faux depth effect. We have been seeing it in side-scrollers for years, but it has recently started showing up in modern web sites. I did see this effect back in the flash days, but has since died off and been reborn. Just about every major web design blog has posted about it, the effect is cool if used in the right way. Most of the sites out now use scrolling to move in a vertical space, but some sites have started appearing using other forms of motion. Some examples are:</p>\n<ul>\n	<li>\n		<a href=\"http://artofflightmovie.com/\">http://artofflightmovie.com/</a></li>\n	<li>\n		<a href=\"http://www.nike.com/jumpman23/aj2012/\">http://www.nike.com/jumpman23/aj2012/</a></li>\n</ul>\n<p>\n	I wanted to create my own parallax script, something that would give me the ability to control multiple objects and move them in different directions. Also have the ability to start and stop the motion when needed, and lock the object to the window or other object... sort of a linking effect. I created a project in github (my first public repo) and called it <strong>whiplash-parallax.&nbsp;</strong>As of this blog post it can only move objects in a straight line in one direction. I will be adding more to this soon, along with building a sandbox template for me to display test along the way.</p>\n<p>\n	Hope you enjoy and please send me feedback or fork and modify your own.</p>\n<p>\n	<a href=\"https://github.com/edmeehan/whiplash-parallax\">https://github.com/edmeehan/whiplash-parallax</a></p>',1343283900,1343285125,'live','3 months','wysiwyg-advanced','','31937e34049ea9b7b71073fa9ec7195c',1,'',NULL),(35,'2012-10-23 01:20:00','2012-10-23 01:20:00',1,NULL,'Capistrano deployment for PyroCMS','capistrano-deployment-pyrocms',11,'','I have recently discovered the joys of automation and deployment with Capistrano. I can now deploy my 140MB project in about 20 seconds with just a click of my mouse.','<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"http://www.youtube.com/embed/kV2Mv3Lb59k?rel=0\" width=\"100%\"></iframe>\n<p>I hope you watched the video above, if not... go view it now!</p>\n\n<p>Here is a list of things to check out before we start. Take some time to read through and get familiar with Capistrano.</p>\n\n<ul>\n	<li>\n	<p><a href=\"http://capistranorb.com/\" target=\"_blank\">http://capistranorb.com/</a></p>\n	</li>\n	<li>\n	<p><a href=\"https://github.com/capistrano/capistrano#readme\" target=\"_blank\">https://github.com/capistrano/capistrano#readme</a></p>\n	</li>\n	<li>\n	<p><a href=\"https://help.github.com/articles/deploying-with-capistrano\" target=\"_blank\">https://help.github.com/articles/deploying-with-capistrano</a></p>\n	</li>\n</ul>\n\n<p>I am going to assume you have ruby installed (1.3.x or greater) if not you need to <a href=\"http://www.ruby-lang.org/en/downloads/\" target=\"_blank\">install it here</a>.</p>\n\n<h2>Okay, let&#39;s get started</h2>\n\n<p>Install the Capistrano gem</p>\n\n<pre>\n$ gem install capistrano</pre>\n\n<p>And also the <a href=\"https://github.com/leehambley/railsless-deploy\" target=\"_blank\">railsless-deploy gem</a>, the helps remove some of the unwanted functions from rails deployments.</p>\n\n<pre>\n$ gem install railsless-deploy</pre>\n\n<p>I also installed the <a href=\"https://github.com/jamis/capistrano-ext#readme\" target=\"_blank\">extension gem</a>, but this is optional</p>\n\n<pre>\n$ gem install capistrano-ext</pre>\n\n<p>Now that you have Capistrano installed you are going to need to check your SSH access to your remote server, also might be a good idea to set up an SSH key if you don&#39;t already have one. The big advantage of using keys is you don&#39;t need to enter your password on each deployment, big time saver if your passwords are crazy long like mine are. Check out your hosting providers documentation on setting up an SSH key. If you&#39;re on windows you need to <a href=\"http://www.chiark.greenend.org.uk/~sgtatham/putty/download.html\" target=\"_blank\">install Putty</a> to test your SSH connection. This is also a good time to test your connection to your GIT repo from your remote server. Since your remote will be running GIT commands through Capistrano you will need to make sure you add the remote key to your GIT repo. Most of my trial and error was getting the SSH keys to work, also something to note is that my host gator account blocks the GIT path when updating submodules, so I had to use the HTTPS instead. When you have tested your SSH access and can successfully access your GIT repo from your remote your ready to start using Capistrano.</p>\n\n<h3>Cap that project</h3>\n\n<p>Start a terminal window and go to your project folder</p>\n\n<pre>\n$ cd my-project-folder\n$ capify .</pre>\n\n<p>The capify command should create a file named <strong>Capfile</strong>, open this file and replace the contents with this:</p>\n\n<pre>\nrequire &#39;rubygems&#39;\nrequire &#39;railsless-deploy&#39;\nload    &#39;config/deploy&#39;\n</pre>\n\n<p>save the <strong>Capfile</strong> and open <strong>config/deploy.rb</strong>, this is your configuration file... All the magic starts here. Start off by replacing everything with this:</p>\n\n<pre>\nset :application, &quot;my-application&quot;\nset :repository,  &quot;git@github.com:edmeehan/whiplash-parallax.git&quot;\nset :branch, &quot;master&quot;\nset :port, 2222\nset :scm, :git\nset :user, &quot;remote-user&quot;\nserver &quot;111.111.111.111&quot;, :app, :web, :db, :primary =&gt; true\nset :deploy_to, &quot;/path_from_root/www/#{application}&quot;\nset :copy_exclude, [&quot;.git&quot;, &quot;.DS_Store&quot;, &quot;.gitignore&quot;, &quot;.gitmodules&quot;]\nset :use_sudo, false\nset :git_enable_submodules, 1\n</pre>\n\n<p>update this config to your application and remote access information. A couple of things to note here, I have set the <strong>use_sudo</strong> and <strong>git_enable_submodules</strong> values, read in the documentation about what this and other settings are available.</p>\n\n<h3>Connect to server</h3>\n\n<p>Now that you cap file is set up with the proper configuration you just need to run a few simple cap commands to set everything up. Launch a (ruby) terminal and type this command:</p>\n\n<pre>\n$ cap deploy:setup</pre>\n\n<p>If you have a proper configuration to your server this command should create the basic folder structure needed for Capistrano deploys. If everything looks good you can run this command to make sure it is ready for a deploy:</p>\n\n<pre>\n$ cap deploy:check</pre>\n\n<p>If you get a green light you are ready to go. This procedure is explained in <a href=\"https://github.com/capistrano/capistrano/wiki/2.x-from-the-beginning\">detail here</a>, scroll down to <strong>Setting Up the Server</strong>.</p>\n\n<h3>Deploy</h3>\n\n<p>At this point we should have confirmed our connection to our server is good, if not you need to solve for it first before you can run a deploy. I hit a bit of trial and error mostly because my servers are shared and my permissions are limited, some of my ports were closed, etc, etc. You might run into these same problems so it&#39;s best to just work it out with your hosting provider if you having issues.</p>\n\n<p>Okay, time to run the deploy command:</p>\n\n<pre>\n$ cap deploy</pre>\n\n<p>That is it, if everything is set up properly you should get a terminal response saying everything is working.</p>\n\n<h3>Extra information and scripts</h3>\n\n<p>Since I am not deploying a standard PyroCMS install, I had to make some modifications to my deploy file. Just some basic house cleaning, when you run the <strong>deploy:setup</strong> command you get some folders created on your server, one of them is a shared assets folder. You can place your database config file here, along with other shared assets. I have my deploy script update a symlink to these files on my server.</p>\n\n<pre>\nnamespace :deploy do\n  desc &quot;Run a few commands after the deployment is successful&quot;\n  task :postdeploy_setup do\n  #delete installer  \n    run &quot;rm -r #{release_path}/installer&quot;\n  #delete .htaccess file  \n    run &quot;rm #{release_path}/.htaccess&quot;\n  #update symlink to database.php  \n    run &quot;ln -nfs #{shared_path}/database.php #{release_path}/system/cms/config/database.php&quot;\n  #update symlink to logs\n    run &quot;rm -r #{release_path}/system/cms/logs&quot;\n    run &quot;ln -nfs #{shared_path}/logs #{release_path}/system/cms/logs&quot;\n  #update symlink JS\n    run &quot;ln -nfs #{release_path}/js /public_html/js&quot;\n  #update symlink assets\n    run &quot;ln -nfs #{release_path}/assets /public_html/assets&quot;\n  #move and update index file  \n    run &quot;mv #{release_path}/index.production.php /public_html/index.php&quot;\n    run &quot;rm #{release_path}/index.php&quot;\n    run &quot;chmod 644 /public_html/index.php&quot;\n  end\n\nend\n\nafter &#39;deploy:update_code&#39;, &#39;deploy:postdeploy_setup&#39;\n</pre>\n\n<p>Hope this helps someone, I know this deployment script saves me a ton of time. My average deploy only takes a few seconds and just a single click of the mouse. Also <a href=\"http://www.aptana.com/\">Aptana</a> has a Capistrano deploy GUI, along with your terminal, it is my new favorite tool after using Eclipse. Hope you enjoyed this, please send me your questions, comments, or added notes.</p>',1350955200,1350955200,'live','always','wysiwyg-advanced','','1a59f2fd7f31ad68403bd69c09c3321a',1,'',NULL),(36,'2013-09-06 18:35:00','2013-09-06 18:35:00',1,1,'RV Road Trippin','rv-road-trippin',1,'','Five days on the road in search for surf on the California Coast, from San Diego to Santa Cruz.','<img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/7661b25d2811359\" />\n<p>It only took me 3 years, but I finally took a surfing road trip up the California coast. We started off in San Diego on Tuesday morning and drove up to Santa Cruz and back down Saturday afternoon.</p>\n\n<p><img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/38f499652db31d3\" /></p>\n\n<p>Our first stop along the way was in Malibu, we pulled off the coastal highway to checkout&nbsp;Point Dume&nbsp;and hoped for surf. We were greeted with a beautiful landscape and flat surf. The truth was this trip was planned in the middle of the longest swell low all summer. San Diego had been flat for weeks and it was starting to make me go a little crazy. Even with the flat surf I tried to stay positive that we would get something good along the way. Our next stop in Malibu shined on us a small glimmer of hope. While driving along the coast I spotted what looked like a fun little right breaking off of a rock in the middle of the water. John, who was driving at the time pulled over on the highway and we all jumped out to look. We had stumbled upon Leo Carrillo start park, a small stretch of white sand with a some rocks along the waterline. The rock on the outside formed a nice right that seemed to just roll down the beach, there was also a small side wave from the wrap around the rock that helped give a little push. I checked the surf report to pull the water temp and was told the water was a nice 69 degrees, which&nbsp;is trunkable on a longboard... so I did just that. Upon jumping into the water I quickly discovered the report was wrong, and the temp was more like 61. The cold water didn&#39;t discourage me,&nbsp;I was on this trip to surf and this place was producing some epic little 2-2.5 foot surf.</p>\n\n<p><img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/a03ffb5956b95fd\" /></p>\n\n<p>After surfing for about an hour, I got out and discovered a small bridge for the costal overpass, someone or group of people had painted the bridge. Snapped a few pics, this also was a landmark that helped me discover the name of this place, since at the time we had no clue of what beach we landed on.</p>\n\n<h2><img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/24245ea91f3105c\" /></h2>\n\n<p>We soon got back on the road and headed north to our first camp ground just outside Ventura. We looked for surf along the coast but with the lack of swell and miles of beach break it was not looking promising. When we finally made camp, we all took a look at the small waves just beyond the campground, was not much&nbsp;but I saw potential. Thank goodness I had brought along my big 11&#39; longboard, since just about any bump in the water is surfable with this thing. I took my board out for an evening sesh by myself and had a blast. The waves were small, but the sand bar created some fun fast sections. I got in about a solid hour of surf before it got too dark and headed back to the beach. Our first night on the trip and already had 2 fun sessions, I was crossing my fingers it would be a sign of things to come.</p>\n\n<h2>Day Two</h2>\n\n<p><img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/d16b48565e89e79\" style=\"line-height: 1.6em; opacity: 0.9;\" /></p>\n\n<p>I woke up that morning at the crack of dawn and strolled out to the beach to take a look. The surf had gotten smaller, I didn&#39;t even know that was possible. The fun little 2 footers from the evening before were now just ankle high lake size lappers. I watched for a few minutes with the hope of seeing a set roll through, but no such luck. We packed up our gear and started north again, our next stop would be San Luis Obispo a few hours later. When we arrived in Pismo, just a few minutes south of SLO, we found our lack of surf had followed us north and not even so much as a ripple was rolling in. We took a small pit stop at a point break near Shell Beach, this was a wave I frequented while living in SLO back in 2005. Of course it was flat as a lake and covered in a heavy fog.</p>\n\n<p><img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/9517fd0bf8faa65\" /></p>\n\n<p>So what do you do when the waves are flat? You hit the bars!&nbsp;Since the crew I was with had never seen SLO I took them into town and got lunch at Firestone&#39;s, one of the best BBQ joints on the central coast. We loaded up on good food and took a stroll around town and stopped at the Creeky Tiki Bar and had a few drinks. Random thing happened, a friend who had just moved from SLO and was passing through while packing happened to see me walking through town. He stopped by the bar and had a few with us before heading down to San Diego.</p>\n\n<p>After throwing a few back at the bar we decided to head out towards our camp site for the night. John had reserved us a spot in Morro Bay at a State Park. Since we still had a few hours of sun light left, I convinced the crew to stop at a beach along the way out to Morro, the Sand Spit. When we pulled into the parking lot at the Sand Spit there were a few guys suiting up to go surf. I had a small conversation with one of the guys and he told me a guy just got out of the water and said the waves were &quot;fun&quot;. Seeing as how Pismo was a lake and the walk to the beach is about 1/4 of a mile I didn&#39;t want to suit up and carry my 11&#39; board down on a hunch. We all walked down the trail and over the dunes through the fog, it was something out of a story book. It resembled the landscape from a scene in The Lord of the Rings, I half expected a troop of goblins on horseback to come rushing thru. When we finally made it down to the sand to my surprise there was some fun little 1-2 foot surf.</p>\n\n<p>The Sand Spit is a large stretch of beach, a few miles long and runs north all the way to Morro Rock. I had surfed it a few times back in 2005, and found this place to be very similar to a sandbar we surfed back home in Hawaii at Waiapio Valley. The beach is steep and allows the swell to roll right up on the sand, making for some very fast and hollow shore break. I ran back to the RV and suited up, John and I surfed for about an hour. The waves were small, but I was stoked to be able to surf, was worried I would get snaked on the trip and not surf every day.</p>\n\n<p>After our small session at the Sand Spit we made our way back to Morro, our camp ground was on the edge of the sand just a few hundred yards from the water. I could hear the waves that night, but could tell by the sound it was nothing in size.</p>\n\n<h2>Day Three</h2>\n\n<p>Again I woke at the crack of dawn, walked out to the water wrapped in my blanket. The fog was dense and visibility was only about 30-40 yards or so. When I finally got close enough to see the water it was flat, just as small as Ventura was the morning before. I was bummed, another day of small surf. I walked back to camp and jumped back into bed, defeated in the idea the reported swell was going to arrive. Later that morning the crew discussed our options, the plan was to make it to Santa Cruz, but how we would get there was the tricky part.</p>\n\n<p>From Morro you can take Highway 1 up through Big Sur, a winding road along the edge of steep cliffs and unreal landscapes. It would be a great drive, but a slow one in an RV. Also there are not&nbsp;many beach access points along the road and surfing would be difficult. Thankfully we decided to just take the 101 north to Santa Cruz so we could spend more time up there. It took us about 4 hours to get into southern Santa Cruz, we stopped at a Mexican food joint to fuel up and figure out our camping situation.</p>\n\n<p>I had found a few camp spots along the coast in the area around Capitola. We stopped at a park that had open spaces and pulled into our spot. The park attendants told us there was a beach access trail so we took a stroll and discussed our options for the day. The surf report said it was 1-2 feet, so surfing seemed like it was less of a priority. Some of the guys on the trip were not so gun-ho about surfing and wanted to go to the bars or just tan on the beach. This did not sound like any sort of fun to me. The trip was starting to come to an end and we had no surf to show for it. While looking for the beach access trail we came upon a bluff that over looked the bay and views north up towards Santa Cruz. The beach below us was flat just as Ventura and Morro had been. Off in the distance to a peak in the north we saw white wash on the coast. This seemed odd to me, since the surf reports all said it was flat. But this white wash on the coast was forming into lines, surfable lines. I could tell by the size and the distance it was not 2 foot as predicted. We started to debate on what to do, the idea of tanning and hitting the bars was still getting tossed around. At this point I was getting frustrated, I could see the waves, just a few miles away and it sounded like we were not going to check it out. After more debate a decision was made to check the surf in passing before heading to the store to pick up supplies. This would prove to be the best decision of the trip.</p>\n\n<p><img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/2918426642fbcff\" /></p>\n\n<p>We drove out to an area called Pleasure Point, and found some parking near a surf spot named The Hook. Upon running out to view the surf I asked a local about the size, and his reply was something along the lines of: &quot;Super fun, about head high on sets&quot;. Head high on sets! Holy shit, we have been chasing knee high surf all week. The movie Endless Summer said it best, surfers dream wave while traveling is clean conditions around head high. This spot was just that, a perfect right with consistent 3-4 foot waves and a few random sets hitting around the high 6 foot mark. I was in heaven, and to top it off this swell was not on the map, so not many surfers knew about it. There were only a few guys in the water.</p>\n\n<p>The local scene was mellow, I chatted it up with a few guys and told them of our trip from San Diego and how stoked we were for these waves. I got a nice set wave and tried my best to get around a wide section, but it was much faster than I expected and kept getting close outs. A few sets even opened up, and one of the local groms got a grab rail tube ride. It was like a dream, first time to Santa Cruz and we get epic surf, I was stoked. The Hook is just south east of Pleasure Point, and from what I could see that wave&nbsp;a sick long right, but crowded. I am sure it is something like Swami&#39;s in Encinitas, great wave but crowded with locals and learners.</p>\n\n<p><img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/1eb01aebdf88070\" /></p>\n\n<p>That night at our camp ground the surf stoke was strong. The idea of bigger surf made for good camp fire chatter. But we were not the only ones up by camp fire light that evening, apparently the raccoon population is high in that area. Our RV was raided for a bag of chips, and the theif would have gotten away with it if he/she didn&#39;t knock items off the counter. The crashing sound was a dead give away, that and the sound of a plastic bag being dragged on pavement. I guess stealth is not always raccoon game plan, sometimes a good smash and grab works too. Later that night while in my tent a raccoon woke me up jumping through the bushes, I didn&#39;t feel super safe with only a small layer of nylon between me and them.</p>\n\n<h2>Day Four</h2>\n\n<p>Same as before I wake up and walked out to the bluff to check the surf. There was still some whitewash on the coast but it looked smaller. We talked of a dawn session, but since the waves were smaller it seemed best to take our time and have a big breakfast, we would need the energy. We surfed The Hook again, it was smaller but there were still some head high sets. Also the word had spread that the waves were good, the crowd had tripled. This also upped the local vibe, people were snaking waves and dropping in left and right. I was on my 11&#39; board, so I tried not to just jump straight into the pack and slowly ease my way into the lineup. Didn&#39;t seem to work to well because I got dropped in on time and time again. The peak I was surfing the day before has crowded with a group of about 10 guys. I could tell by the way they grouped up they all knew each other. The localism was strong this day.</p>\n\n<p>Since the point looked good and a spot just inside of it had some nice waves we decided to paddle west across the bay to the next peak about 400 yards away. The crowd looked thin from a distance, but upon arrival I found it was dense with longboarders. Most of them were either just learning to surf, or their&nbsp;first day in the water. A few of the guys on the outside were locals so I decided to form up with the local pack and wait for a set. I wish I had a camera to take a picture of the crowd, the right was so dense with longboarders sitting around the inside you couldn&#39;t even pick a line. My first set wave I took off deep behind the right peak, had to hoot off a few people and dodge a few more inside but I somehow managed to catch it all the way to the beach. With the exception of the crowd this was an epic wave. My ride felt like 30 seconds and no close out sections.</p>\n\n<p>After a few hours we all got out of the water and got lunch, I was still on a high from the conditions the day before so decided to go back out. The rest of the crew took off on foot to check out the local bar scene. My second session was not less crowded than the first but I kept telling myself how lucky I was to be getting waves like this. It was so surreal, a foreign area and good surf. My imagination could have put me anywhere, the landscape around pleasure point is awesome. Rocky coves and lots of evergreen trees, and the water temp was warmer than down south.</p>\n\n<p>Later that night we decided to start heading back down to San Diego, we needed to drop off the RV that next afternoon and it was still 10 hours of driving ahead of us. We drove down to a rest stop just north of Santa Barbra to rest for the night. Parked on the side of the highway and trying to sleep in the passenger seat was no fun, I kept waking up when big rigs would pass by and shake the RV. At one point in the night John woke up yelling that we were moving, and for a split second I believed him... but it was just the illusion of passing trucks shacking the RV.</p>\n\n<h2>Day Five -The Final Day</h2>\n\n<p>I was awoken at 6am to the sound of John&#39;s phone alarm and was picked as driver for that morning stretch. I drove us down to Rincon just between Ventura and Santa Barbra, and almost passed the exit but just happened I pulled into it when I stopped to check the map. It was about 6:40am when we pulled into the parking lot, the rest of the crew was still sleeping in their&nbsp;beds. When I arrived there was only one other car in the lot, and while walking down the trail I happened upon the lone surfer heading back to his car after surfing. This guy was a true surf nut, already out of the water by 7am from a morning session, dang I need to be more like that. I really didn&#39;t expect much since the surf was small down south, but when I took a look at Rincon it was perfect... I mean PERFECT 2 foot waves. I got my 11&#39; long board and got out in the water, John and Chris soon joined me.</p>\n\n<p>Words can&#39;t even do this morning justice, the waves looked like mini Indo, just perfect peeling 2 foot barrels down the beach. The waves would just run perpendicular to the sand for yards, just kept rolling thru. It was unreal! To top it off a pod of dolphins stopped by and started playing in the cove, jumping around and making strange squishy noises. I was in surf bliss. But we had to make the session short since we were on a time line to get to San Diego. Plus a few more local long boarders showed up and I didn&#39;t want to steal all there waves. I got a few perfect little rights, tried to duck in and get barreled but it was too small and just drilled my head.</p>\n\n<p><img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/eecc7f0e470c62f\" /></p>\n\n<p>We left that perfect session just stoked, I don&#39;t know if the other guys know how good it was. I have been surfing for years and have only seen conditions that clean a few dozen times, we were very lucky that morning.</p>\n\n<p>A long drive ahead of us the stoke slowly wore off, the traffic and driving put reality back in our minds and the trip was soon over. I was a little sad, but also happy to be home. I am sure the guys were glad to be rid of me, since I kept nagging about surfing the whole trip and don&#39;t know if everyone was on my same level of thinking. Regardless of everyone else I had a great time, and this will be a trip I will remember for a long time. It has also sparked a desire to start camping more, something I don&#39;t do enough of these days... was my first camping trip in 3-4 years. On final note, my drive back home thru San Diego gave for a nice surprise, the flat spell had broken and small waves returned to north county. Maybe it is magic, or maybe just dumb luck, whatever it is I want to believe our trip made it happen.</p>\n\n<p><img alt=\"\" class=\"pyro-image alignment-none\" data-pyroimage=\"true\" src=\"{{ url:site }}files/large/c3fd60d99f39135\" /></p>',1378492500,1378492500,'live','no','wysiwyg-advanced','','1135e21e5c4762e91e0663115ea3316c',1,'','dummy'),(37,'2015-04-30 09:34:00','2015-04-30 09:34:00',1,2,'Back in Hawaii','back-in-hawaii',1,'','This will be the post here.','This is the post here.',1430386440,1430386440,'draft','no','wysiwyg-advanced','','9e13bb1b5a6173da535cd32090a82aa1',1,'0f8037405358e2970fad42abdfdd9954','b7717770ea10671');
