INSERT INTO `emeehan_comments` VALUES (4,1,0,'HollystarPR','hollyegunn@gmail.com','','Sounds like my day, except you’re missing…\n11:30am – 12:30pm Stop home during lunch to feed and walk the puppy\n6:15pm – 7:15pm Hip Hop Cardio and 15min Abs at 24Hour','blog','16','1219266900','65.38.112.140','','Life in 20 something.','blog:post','blog:posts','blog/2008/05/life-in-20-something','admin/blog/preview/16'),(5,1,0,'yo real mama','mae@emeehan.com','NULL','Way to go Ed…keep up the running…great way to keep track. Love u','blog','22','1228639500','70.245.31.138','','The 100 Mile Challenge','blog:post','blog:posts','blog/2008/10/the-100-mile-challenge','admin/blog/preview/22'),(6,1,0,'David Lee','djteknokid@hotmail.com','http://djteknokid.blogspot.com','\n hey man. update more often. i really like seeing your personal life here more than the career related stuff.','blog','25','1248670020','72.48.91.219','','Ghost on Town Lake','blog:post','blog:posts','blog/2009/06/ghost-on-town-lake','admin/blog/preview/25'),(7,1,0,'Brigett Colmenero','','','my pic is the coolest&amp;hellip;','blog','27','1263707580','71.20.73.93','<p>my pic is the coolest&amp;hellip;</p>\n','Text Message Chain Mail','blog:post','blog:posts','blog/2010/01/text-message-chain-mail','admin/blog/preview/27'),(8,1,1,'Edward Meehan','edward.meehan.808@gmail.com','','I finished challenge with one day to spare.','blog','22','1343713422','72.130.141.203','<p>I finished challenge with one day to spare.</p>\n','The 100 Mile Challenge','blog:post','blog:posts','blog/2008/10/the-100-mile-challenge','admin/blog/preview/22'),(9,1,0,'Scott Hay-roe','scottbyme@aol.com','','So happy for your stoke Ed!  If it makes you feel any better, I just got back from O&amp;#39;ahu where it was flat the entire two weeks.  Got a bit of windswell on the windward side but no south or north swells.    I was just telling Jennifer we have got to do a road trip down to the Big Sur area, I&amp;#39;ve never been there!   Keep the stoke alive Ed!  Aloha.','blog','36','1378577215','67.189.120.176','<p>So happy for your stoke Ed!  If it makes you feel any better, I just got back from O&amp;#39;ahu where it was flat the entire two weeks.  Got a bit of windswell on the windward side but no south or north swells.    I was just telling Jennifer we have got to do a road trip down to the Big Sur area, I&amp;#39;ve never been there!   Keep the stoke alive Ed!  Aloha.</p>\n','RV Road Trippin','blog:post','blog:posts','blog/2013/09/rv-road-trippin',NULL);
