ndy Irons was the World Champ at the time.  An unusual swell hit the north shore of Kauai in August and I happend to be at Pinetrees with my family.  The surf was head high plus really good.  Other than the surfers in the water we were pretty much the only people on the beach we were just going to surf for a while and hang out.  My son was 11 or 12 at the time and spotted the board first with all the sponsorship stickers and then the signature black and white plad Billabong trunks running across the beach toward the water. It was Andy Irons running right by on his way to the water. (My son and I went out and bought those trunks the next day still have them.)  My son was beyond stoked.  He idolized Andy Irons, still does. He is 20 years old now and was in Kauai when Andy passed he called to tell me the news.  He was devistated.  The only thing I can really compare it to was how I felt when I heard John Lennon had died.   Anyway back to the story My son got to paddel out that day and hang out in the water with his hero for a few hours even caught a few waves. He was so excited he stayed in the water until Andy got out.  We got to sit on the beach by ourselves and watch Andy Irons put on a clinic. No big camera lenses around no crowds just Andy Irons and a bunch of other guys out in head high surf in the afternoon ripping it up with the Druary family sitting on the beach.  It is one of my favorite life moments. Still have the photos we took that day.  My son and daughter still talk about it. We surf at Trestles alot so seeing the pros out in the water is pretty common but us regular dudes don\'t end up in the water with guys like Andy Irons often.    Some would think this is kind of silly but anyone who surfs knows how cool this was for me and my kids.    Andy Irons never even knew we were there or that he had any impact on these folks from California that just happend to be lucky enough to be in a right spot at a right time.   My guess is that there are a million stories out there just like mine people saying yea remember when we saw him or meet him etc.    He will be greatly missed by the surfing community and I am sure by the people like you guys that were lucky enough to hang out with him.   We got to for one afternoon.     AlohaBob\r\n\r\n				Rakesh,\r\n				maycon@icohet.com.br','Internet Explorer 6.0','108.162.231.200','Windows XP',1339965387,''),(33,'info@ehyaa.com','eMeehan.com :: ','This message was sent via the contact form on with the following details:\r\n				<hr />\r\n				IP Address: 1.232.19.111\r\n				OS Windows XP\r\n				Agent Opera 8.01\r\n				<hr />\r\n				I never tuhoght I would find such an everyday topic so enthralling!\r\n\r\n				Bobcat,\r\n				info@ehyaa.com','Opera 8.01','1.232.19.111','Windows XP',1339990352,''),(34,'mae.kaler@gmail.com','eMeehan.com :: ','This message was sent via the contact form on with the following details:\r\n				<hr />\r\n				IP Address: 108.162.215.142\r\n				OS Unknown Windows OS\r\n				Agent Chrome 19.0.1084.56\r\n				<hr />\r\n				very impressive!\r\n\r\n				Your mother,\r\n				mae.kaler@gmail.com','Chrome 19.0.1084.56','108.162.215.142','Unknown Windows OS',1340689346,''),(35,'aimee.quizala@rcggs.com','eMeehan.com :: ','This message was sent via the contact form on with the following details:\r\n				<hr />\r\n				IP Address: 120.28.16.200\r\n				OS Windows XP\r\n				Agent Chrome 21.0.1180.83\r\n				<hr />\r\n				Good day!\n\nThis is Christine from RCG Global Services. I would like to discuss a job opportunity with you. We are currently in need of a Web Developer for one of our major client. Based on your profile, you can be a good fit for this requirement.\n\nHere\'s the job description for your review: \n\nJob Location:		San Clemente, CA\nJob Position:		Web Developer\nJob Type:		Contract to Hire\n\nJob Description:\n\nThe client is seeking a web developer with 7+ years experience, possessing an EXPERT-level proficiency in CSS and HTML. \n\n·	Must posses knowledge of newest st