INSERT INTO `emeehan_email_templates` VALUES (1,'comments','Comment Notification','Email that is sent to admin when someone creates a comment','You have just received a comment from {{ name }}','<h3>You have received a comment from {{ name }}</h3><strong>IP Address: {{ sender_ip }}</strong>\n<strong>Operating System: {{ sender_os }}\n<strong>User Agent: {{ sender_agent }}</strong>\n<div>{{ comment }}</div>\n<div>View Comment:{{ redirect_url }}</div>','en',1,'comments'),(2,'contact','Contact Notification','Template for the contact form','{{ settings:site_name }} :: {{ subject }}','This message was sent via the contact form on with the following details:\r\n				<hr />\r\n				IP Address: {{ sender_ip }}\r\n				OS {{ sender_os }}\r\n				Agent {{ sender_agent }}\r\n				<hr />\r\n				{{ message }}\r\n\r\n				{{ name }},\r\n				{{ email }}','en',1,'pages'),(3,'registered','New User Registered','The email sent to the site contact e-mail when a new user registers','{{ settings:site_name }} :: You have just received a registration from {{ name}','<h3>You have received a registration from {{ name}</h3><strong>IP Address: {{ sender_ip }}</strong>\r\n				<strong>Operating System: {{ sender_os }}\r\n				<strong>User Agent: {{ sender_agent }}</strong>','en',1,'users'),(4,'newsletters_opt_in','Newsletters Opt In','Template for the email that\'s sent when a user subscribes.','{{ settings:site_name }} :: Newsletter Activation','<h3>You have recently subscribed to the newsletter at {{ settings:site_name }}</h3>\r\n			<p><strong>To verify that you wish to have your email address added to our list you must click the activation link below.</strong><strong> </strong></p>\r\n			<p><strong>If you did not sign up at our website please disregard this email. No further action is necessary.</strong></p>\r\n			<p><span>Complete signup: <a href=\"{{ newsletter_activation }}\">{{ newsletter_activation }}</a></span></p>\r\n			','en',1,''),(5,'activation','Activation Email','The email which contains the activation code that is sent to a new user','{{ settings:site_name }} - Account Activation','<p>Hello {{ user:first_name }},</p>\r\n									<p>Thank you for registering at {{ settings:site_name }}. Before we can activate your account, please complete the registration process by clicking on the following link:</p>\r\n									<p><a href=\"{{ url:site }}users/activate/{{ user:id }}/{{ activation_code }}\">{{ url:site }}users/activate/{{ user:id }}/{{ activation_code }}</a></p>\r\n									<p>&nbsp;</p>\r\n									<p>In case your email program does not recognize the above link as, please direct your browser to the following URL and enter the activation code:</p>\r\n									<p><a href=\"{{ url:site }}users/activate\">{{ url:site }}users/activate</a></p>\r\n									<p><strong>Activation Code:</strong> {{ activation_code }}</p>','en',1,'users'),(6,'forgotten_password','Forgotten Password Email','The email that is sent containing a password reset code','{{ settings:site_name }} - Forgotten Password','<p>Hello {{ user:first_name }},</p>\r\n									<p>It seems you have requested a password reset. Please click this link to complete the reset: <a href=\"{{ url:site }}users/reset_pass/{{ user:forgotten_password_code }}\">{{ url:site }}users/reset_pass/{{ user:forgotten_password_code }}</a></p>\r\n									<p>If you did not request a password reset please disregard this message. No further action is necessary.</p>','en',1,'users'),(7,'new_password','New Password Email','After a password is reset this email is sent containing the new password','{{ settings:site_name }} - New Password','<p>Hello {{ user:first_name }},</p>\r\n									<p>Your new password is: {{ new_password }}</p>\r\n									<p>After logging in you may change your password by visiting <a href=\"{{ url:site }}edit-profile\">{{ url:site }}edit-profile</a></p>','en',1,'users');
/*!40000 ALTER TABLE `emeehan_email_templates` ENABLE KEYS */;
UNLOCK TABLES;

