";s:2:\"se\";s:66:\"Hantera globala variabler som kan avändas över hela webbplatsen.\";}',0,0,1,'data',1,1,1,1429610652),(21,'a:23:{s:2:\"en\";s:7:\"Widgets\";s:2:\"br\";s:7:\"Widgets\";s:2:\"pt\";s:7:\"Widgets\";s:2:\"cs\";s:7:\"Widgety\";s:2:\"da\";s:7:\"Widgets\";s:2:\"de\";s:7:\"Widgets\";s:2:\"el\";s:7:\"Widgets\";s:2:\"es\";s:7:\"Widgets\";s:2:\"fa\";s:13:\"ویجت ها\";s:2:\"fi\";s:9:\"Vimpaimet\";s:2:\"fr\";s:7:\"Widgets\";s:2:\"id\";s:6:\"Widget\";s:2:\"it\";s:7:\"Widgets\";s:2:\"lt\";s:11:\"Papildiniai\";s:2:\"nl\";s:7:\"Widgets\";s:2:\"ru\";s:14:\"Виджеты\";s:2:\"sl\";s:9:\"Vtičniki\";s:2:\"tw\";s:9:\"小組件\";s:2:\"cn\";s:9:\"小组件\";s:2:\"hu\";s:9:\"Widget-ek\";s:2:\"th\";s:21:\"วิดเจ็ต\";s:2:\"se\";s:8:\"Widgetar\";s:2:\"ar\";s:14:\"الودجتس\";}','widgets','1.1',NULL,'a:23:{s:2:\"en\";s:69:\"Manage small sections of self-contained logic in blocks or \"Widgets\".\";s:2:\"ar\";s:132:\"إدارة أقسام صغيرة من البرمجيات في مساحات الموقع أو ما يُسمّى بالـ\"ودجتس\".\";s:2:\"br\";s:77:\"Gerenciar pequenas seções de conteúdos em bloco conhecidos como \"Widgets\".\";s:2:\"pt\";s:74:\"Gerir pequenas secções de conteúdos em bloco conhecidos como \"Widgets\".\";s:2:\"cs\";s:56:\"Spravujte malé funkční části webu neboli \"Widgety\".\";s:2:\"da\";s:74:\"Håndter små sektioner af selv-opretholdt logik i blokke eller \"Widgets\".\";s:2:\"de\";s:62:\"Verwaltet kleine, eigentständige Bereiche, genannt \"Widgets\".\";s:2:\"el\";s:149:\"Διαχείριση μικρών τμημάτων αυτόνομης προγραμματιστικής λογικής σε πεδία ή \"Widgets\".\";s:2:\"es\";s:75:\"Manejar pequeñas secciones de lógica autocontenida en bloques o \"Widgets\"\";s:2:\"fa\";s:76:\"مدیریت قسمت های کوچکی از سایت به طور مستقل\";s:2:\"fi\";s:81:\"Hallitse pieniä osioita, jotka sisältävät erillisiä lohkoja tai \"Vimpaimia\".\";s:2:\"fr\";s:41:\"Gérer des mini application ou \"Widgets\".\";s:2:\"id\";s:101:\"Mengatur bagian-bagian kecil dari blok-blok yang memuat sesuatu atau dikenal dengan istilah \"Widget\".\";s:2:\"it\";s:70:\"Gestisci piccole sezioni di logica a se stante in blocchi o \"Widgets\".\";s:2:\"lt\";s:43:\"Nedidelių, savarankiškų blokų valdymas.\";s:2:\"nl\";s:75:\"Beheer kleine onderdelen die zelfstandige logica bevatten, ofwel \"Widgets\".\";s:2:\"ru\";s:91:\"Управление небольшими, самостоятельными блоками.\";s:2:\"sl\";s:61:\"Urejanje manjših delov blokov strani ti. Vtičniki (Widgets)\";s:2:\"tw\";s:103:\"可將小段的程式碼透過小組件來管理。即所謂 \"Widgets\"，或稱為小工具、部件。\";s:2:\"cn\";s:103:\"可将小段的程式码透过小组件来管理。即所谓 \"Widgets\"，或称为小工具、部件。\";s:2:\"hu\";s:56:\"Önálló kis logikai tömbök vagy widget-ek kezelése.\";s:2:\"th\";s:152:\"จัดการส่วนเล็ก ๆ ในรูปแบบของตัวเองในบล็อกหรือวิดเจ็ต\";s:2:\"se\";s:83:\"Hantera små sektioner med egen logik och innehåll på olika delar av webbplatsen.\";}',1,0,1,'content',1,1,1,1429610652),(38,'a:16:{s:2:\"sl\";s:8:\"Galerija\";s:2:\"en\";s:9:\"Galleries\";s:2:\"el\";s:14:\"Γκαλερί\";s:2:\"de\";s:8:\"Galerien\";s:2:\"pl\";s:7:\"Galerie\";s:2:\"nl\";s:10:\"Gallerijen\";s:2:\"fr\";s:8:\"Galeries\";s:2:\"zh\";s:6:\"畫廊\";s:2:\"it\";s:8:\"Gallerie\";s:2:\"ru\";s:14:\"Галереи\";s:2:\"ar\";s:23:\"معارض الصّور\";s:2:\"br\";s:8:\"Galerias\";s:2:\"cs\";s:7:\"Galerie\";s:2:\"es\";s:9:\"Galerías\";s:2:\"fi\";s:9:\"Galleriat\";s:2:\"lt\";s:9:\"Galerijos\";}','galleries','1.4',NULL,'a:16:{s:2:\"sl\";s:60:\"Modul galerije vam omogoča da ustvarite albume vaših slik.\";s:2:\"en\";s:82:\"The galleries module is a simple module that lets users display images from Files.\";s:2:\"el\";s:127:\"Παρέχει την δυνατότητα στους χρήστες να δημιουργούν άλμπουμ εικόνων.\";s:2:\"de\";s:55:\"Mit dem Galerie Modul kannst du Bildergalerien anlegen.\";s:2:\"pl\";s:45:\"Moduł pozwalający tworzyć galerie zdjęć.\";s:2:\"nl\";s:80:\"De gallerij module die gebruikers in staat stelt afbeeldingsgallerijen te maken.\";s:2:\"fr\";s:79:\"Galerie est une puissante extension permettant de créer des galeries d\'images.\";s:2:\"zh\";s:90:\"這是一個功能完整的畫廊模組，可以讓用戶建立自己的畫本或相簿。\";s:2:\"it\";s:96:\"Il modulo gallerie è un potente modu