INSERT INTO `emeehan_search_index` VALUES (1,'Home','',NULL,NULL,'pages','pages:page','pages:pages','1','home','admin/pages/edit/1','admin/pages/delete/1'),(2,'Page missing','',NULL,NULL,'pages','pages:page','pages:pages','2','404','admin/pages/edit/2','admin/pages/delete/2'),(9,'Kevin Federline - VMA joke','\n	FEDDER&nbsp;- the action of money equals talent','rant','4e0f911170fe481445de658d6692a237','blog','blog:post','blog:posts','1','blog/2006/09/personal','admin/blog/edit/1','admin/blog/delete/1'),(10,'Welcome to Suburbia!!','\n	So I now find my self in the suburbia race to quarter acre perfection.','rant','9d956ae8add6f6d020cf7efec04b3306','blog','blog:post','blog:posts','2','blog/2006/10/welcome-to-suburbia','admin/blog/edit/2','admin/blog/delete/2'),(11,'I must be hot sex','\n	I must be hot sex because all the ladies want dez nutz!','rant','f2af8c3af16909550b5084b0da3fa492','blog','blog:post','blog:posts','3','blog/2007/04/i-must-be-hot-sex','admin/blog/edit/3','admin/blog/delete/3'),(12,'Found it!!','\n	So now I have a new passion and something to get in the water for again, it might not be surfing and nothing like the beaches in Hawaii... but for me it&#39;s the release I have been looking a long time for.','health','8d31b7f8a576f4e8015460b887ac2d21','blog','blog:post','blog:posts','4','blog/2007/06/found-it','admin/blog/edit/4','admin/blog/delete/4'),(13,'Where is Napoleon?','\n	It&#39;s cool in Europe.','rant','f34b4cfe5bca0f6ecae1ec4cbddc276b','blog','blog:post','blog:posts','5','blog/2007/08/where-is-napoleon','admin/blog/edit/5','admin/blog/delete/5'),(14,'The Start of a new blog','\n	Okay so this is day one of my new blog and am switching my CMS from&nbsp;ModX&nbsp;to&nbsp;WordPress.','rant','e14facb81a20d55ff78d424a3b3c27f4','blog','blog:post','blog:posts','6','blog/2007/09/the-start-of-a-new-blog','admin/blog/edit/6','admin/blog/delete/6'),(15,'Good Times','\n	Back in the day the good times were some friends and I taking a road trip to Kona/Waipio Valley in one of my many busted ass cars.','reflections','cec6807aa8b41ce821833065dc001086','blog','blog:post','blog:posts','7','blog/2007/09/good-times','admin/blog/edit/7','admin/blog/delete/7'),(16,'No do overs','\n	I am here today, so I live today.... I can&#39;t wait for tomorrow, for all I know tomorrow might never come.','rant','758a6f76e62de2d9ea576e9107c92219','blog','blog:post','blog:posts','8','blog/2007/10/no-do-overs-rant','admin/blog/edit/8','admin/blog/delete/8'),(17,'I miss surfing!!!','\n	When I had a problem, I surfed. When I had a bad day, I surfed.','rant','d227472950bcc1281e4d7a42a01e35aa','blog','blog:post','blog:posts','9','blog/2007/11/i-miss-surfing','admin/blog/edit/9','admin/blog/delete/9'),(18,'California VS Texas - Round One','\n	The two years in California I made some great friends, and may not stay in touch as much as I would like, I consider them some of the most influential people in my life.','rant','e1f0260062c8da511c42863c4d9a7518','blog','blog:post','blog:posts','10','blog/2007/11/california-vs-texas-round-one','admin/blog/edit/10','admin/blog/delete/10'),(19,'Coke & SUV’s make midgets angry.','\n	The little one keeps running his mouth like a strip bar disc jockey.','night-life','0583f632dce025be8bbc92db93d79e22','blog','blog:post','blog:posts','12','blog/2008/02/coke-suvs-make-midgets-angry','admin/blog/edit/12','admin/blog/delete/12'),(20,'Most Wanted','\n	Not to say I am satisfied with my current state, I am always making efforts to improve myself and my talents.','career','a81552fe6e7c0e7b53568d77185bb27c','blog','blog:post','blog:posts','13','blog/2008/03/most-wanted','admin/blog/edit/13','admin/blog/delete/13'),(21,'I’m breaking up with you!','\n	It&#39;s over, I&#39;m breaking up with you Down Town Austin (West 6th, Dirty 6th, 4th &amp;amp; Warehouse).','night-life','3de01e972c600deb93e587570b4ae376','blog','blog:post','blog:posts','14','blog/2008/04/im-breaking-up-with-you','admin/blog/edit/14','admin/blog/delete/14'),(22,'Tornado Warning!','\n	So this Friday night was my first real tornado watch here in Texas.','random','80725bee5946e57371b4923548de1b15','blog','blog:post','blog:posts','15','blog/2008/05/tornado-warning','admin/blog/edit/15','admin/blog/delete/15'),(23,'Life in 20 something.','\n	Well it&#39;s late, and I always seem to reflect on my past at 1am sitting in my office.','rant','510f018ddcc22b5205e8665b8d87815e','blog','blog:post','blog:posts','16','blog/2008/05/life-in-20-something','admin/blog/edit/16','admin/blog/delete/16'),(24,'Faces and HipHop!','\n	WOW, am I growing up, or am I still that kid I was 8 years ago?','rant','83fb364602e01cffb1c896e9b4e49688','blog','blog:post','blog:posts','17','blog/2008/09/faces-and-hiphop','admin/blog/edit/17','admin/blog/delete/17'),(25,'West Six','\n	I know I was wrong to leave you. You may not be right for me but you&rsquo;re always true to me.','night-life','b571d5ee31d875dbf32f2c2b3138a4c8','blog','blog:post','blog:posts','18','blog/2008/09/west-six','admin/blog/edit/18','admin/blog/delete/18'),(26,'Don\'t be so negative!','\n	I came upon a small bag of old negatives that I must have grabbed from Hawaii a few years ago.','reflections','1fbde1d165454e614c09d4ea84c63fe1','blog','blog:post','blog:posts','19','blog/2008/09/dont-be-so-negative','admin/blog/edit/19','admin/blog/delete/19'),(27,'Family Ties','\n	She give me solid advice, and damn is it good.','reflections','47b53bea278845f8a02de93e19fd8a17','blog','blog:post','blog:posts','20','blog/2008/09/family-ties','admin/blog/edit/20','admin/blog/delete/20'),(28,'Flyin Hawaiian','\n	Thought I would post a few pictures from the company boat trip this last Thursday. Everyone had a good time, lots of food, beer, and perfect weather.','work event','56a92a393940117a4a243f5905d94f43','blog','blog:post','blog:posts','21','blog/2008/09/flyin-hawaiian','admin/blog/edit/21','admin/blog/delete/21'),(29,'The 100 Mile Challenge','\n	I decided that it was time I kicked my running up a notch