6,'Patio Surf Rack Build','\n	I built a sweet rack for my surfboards this weekend. Going to do a little DIY walk through and instruction for the interwebs.','diy, surfing','8e33b25d50a81e27a8617d96dd200dac','blog','blog:post','blog:posts','31','blog/2012/05/patio-surf-rack-build','admin/blog/edit/31','admin/blog/delete/31'),(37,'Whiplash Parallax','Parallax seems to be all over the web these days. I wanted to create a custom script with simple effects and share it on github.','javascript, jquery, parallax','31937e34049ea9b7b71073fa9ec7195c','blog','blog:post','blog:posts','33','blog/2012/07/whiplash-parallax','admin/blog/edit/33','admin/blog/delete/33'),(39,'Capistrano deployment for PyroCMS','\nI hope you watched the video above, if not... go view it now!\n\nHere is a list of things to check out before we start. Take some time to read through and get familiar with Capistrano.\n\n\n	\n	http://capistranorb.com/\n	\n	\n	https://github.com/capistrano/capistrano#readme\n	\n	\n	https://help.github.com/articles/deploying-with-capistrano\n	\n\n\nI am going to assume you have ruby installed (1.3.x or greater) if not you need to install it here.\n\nOkay, let&#39;s get started\n\nInstall the Capistrano gem\n\n\n$ gem install capistrano\n\nAnd also the railsless-deploy gem, the helps remove some of the unwanted functions from rails deployments.\n\n\n$ gem install railsless-deploy\n\nI also installed the extension gem, but this is optional\n\n\n$ gem install capistrano-ext\n\nNow that you have Capistrano installed you are going to need to check your SSH access to your remote server, also might be a good idea to set up an SSH key if you don&#39;t already have one. The big advantage of using keys is you don&#39;t need to enter your password on each deployment, big time saver if your passwords are crazy long like mine are. Check out your hosting providers documentation on setting up an SSH key. If you&#39;re on windows you need to install Putty to test your SSH connection. This is also a good time to test your connection to your GIT repo from your remote server. Since your remote will be running GIT commands through Capistrano you will need to make sure you add the remote key to your GIT repo. Most of my trial and error was getting the SSH keys to work, also something to note is that my host gator account blocks the GIT path when updating submodules, so I had to use the HTTPS instead. When you have tested your SSH access and can successfully access your GIT repo from your remote your ready to start using Capistrano.\n\nCap that project\n\nStart a terminal window and go to your project folder\n\n\n$ cd my-project-folder\n$ capify .\n\nThe capify command should create a file named Capfile, open this file and replace the contents with this:\n\n\nrequire &#39;rubygems&#39;\nrequire &#39;railsless-deploy&#39;\nload    &#39;config/deploy&#39;\n\n\nsave the Capfile and open config/deploy.rb, this is your configuration file... All the magic starts here. Start off by replacing everything with this:\n\n\nset :application, &quot;my-application&quot;\nset :repository,  &quot;git@github.com:edmeehan/whiplash-parallax.git&quot;\nset :branch, &quot;master&quot;\nset :port, 2222\nset :scm, :git\nset :user, &quot;remote-user&quot;\nserver &quot;111.111.111.111&quot;, :app, :web, :db, :primary =&gt; true\nset :deploy_to, &quot;/path_from_root/www/#{application}&quot;\nset :copy_exclude, [&quot;.git&quot;, &quot;.DS_Store&quot;, &quot;.gitignore&quot;, &quot;.gitmodules&quot;]\nset :use_sudo, false\nset :git_enable_submodules, 1\n\n\nupdate this config to your application and remote access information. A couple of things to note here, I have set the use_sudo and git_enable_submodules values, read in the documentation about what this and other settings are available.\n\nConnect to server\n\nNow that you cap file is set up with the proper configuration you just need to run a few simple cap commands to set everything up. Launch a (ruby) terminal and type this command:\n\n\n$ cap deploy:setup\n\nIf you have a proper configuration to your server this command should create the basic folder structure needed for Capistrano deploys. If everything looks good you can run this command to make sure it is ready for a deploy:\n\n\n$ cap deploy:check\n\nIf you get a green light you are ready to go. This procedure is explained in detail here, scroll down to Setting Up the Server.\n\nDeploy\n\nAt this point we should have confirmed our connection to our server is good, if not you need to solve for it first before you can run a deploy. I hit a bit of trial and error mostly because my servers are shared and my permissions are limited, some of my ports were closed, etc, etc. You might run into these same problems so it&#39;s best to just work it out with your hosting provider if you having issues.\n\nOkay, time to run the deploy command:\n\n\n$ cap deploy\n\nThat is it, if everything is set up properly you should get a terminal response saying everything is working.\n\nExtra information and scripts\n\nSince I am not deploying a standard PyroCMS install, I had to make some modifications to my deploy file. Just some basic house cleaning, when you run the deploy:setup command you get some folders created on your server, one of them is a shared assets folder. You can place your database config file here, along with other shared assets. I have my deploy script update a symlink to these files on my server.\n\n\nnamespace :deploy do\n  desc &quot;Run a few commands after the deployment is successful&quot;\n  task :postdeploy_setup do\n  #delete installer  \n    run &quot;rm -r #{release_path}/installer&quot;\n  #delete .htaccess file  \n    run &quot;rm #{release_path}/.htaccess&quot;\n  #update symlink to database.php  \n    run &quot;ln -nfs #{shared_path}/database.php #{release_path}/system/cms/config/database.php&quot;\n  #update symlink to logs\n    run &quot;rm -r #{release_path}/system/cms/logs&quot;\n    run &quot;ln -nfs #{shared_path}/logs #{release_path}/system/cms/logs&quot;\n  #update symlink JS\n    run &quot;ln -nfs #{release_path}/js /public_html/js&quot;\n  #update symlink assets\n    run &quot;ln -nfs #{release_path}/assets /public_html/assets&quot;\n  #move and update index file  \n    run &quot;mv #{release_path}/index.production.php /public_html/index.php&quot;\n    run &quot;rm #{release_path}/index.php&quot;\n    run &quot;chmod 644 /public_html/index.php&quot;\n  end\n\nend\n\nafter &#39;deploy:update_code&#39;, &#39;deploy:postdeploy_setup&#39;\n\n\nHope this helps someone, I know this deployment script saves me a ton of time. My average deploy only takes a few seconds and just a single click of the mouse. Also Aptana has a Capistrano deploy GUI, along with your terminal, it is my new favorite tool after using Eclipse. Hope you enjoyed this, please send me your questions, comments, or added notes.','automation, capistrano, pyrocms, ruby','1a59f2fd7f31ad68403bd69c09c3321a','blog','blog:post','blog:posts','35','blog/2012/10/capistrano-deployment-pyrocms','admin/blog/edit/35','admin/blog/delete/35'),(67,'RV Road Trippin','\nIt only took me 3 years, but I finally took a surfing road trip up the California coast. We started off in San Diego on Tuesday morning and drove up to Santa Cruz and back down Saturday afternoon.\n\n\n\nOur first stop along the way was in Malibu, we pulled off the coastal highway to checkout&nbsp;Point Dume&nbsp;and hoped for surf. We were greeted with a beautiful landscape and flat surf. The truth was this trip was planned in the middle of the longest swell low all summer. San Diego had been flat for weeks and it was starting to make me go a little crazy. Even with the flat surf I tried to stay positive that we would get something good along the way. Our next stop in Malibu shined on us a small glimmer of hope. While driving along the coast I spotted what looked like a fun little right breaking off of a rock in the middle of the water. John, who was driving at the time pulled over on the highway and we all jumped out to look. We had stumbled upon Leo Carrillo start park, a small stretch of white sand with a some rocks along the waterline. The rock on the outside formed a nice right that seemed to just roll down the beach, there was also a small side wave from the wrap around the rock that helped give a little push. I checked the surf report to pull the water temp and was told the water was a nice 69 degrees, which&nbsp;is trunkable on a longboard... so I did just that. Upon jumping into the water I quickly discovered the report was wrong, and the temp was more like 61. The cold water didn&#39;t discourage me,&nbsp;I was on this trip to surf and this place was producing some epic little 2-2.5 foot surf.\n\n\n\nAfter surfing for about an hour, I got out and discovered a small bridge for the costal overpass, someone or group of people had painted the bridge. Snapped a few pics, this also was a landmark that helped me discover the name of this place, since at the time we had no clue of what beach we landed on.\n\n\n\nWe soon got back on the road and headed north to our first camp ground just outside Ventura. We looked for surf along the coast but with the lack of swell and miles of beach break it was not looking promising. When we finally made camp, we all took a look at the small waves just beyond the campground, was not much&nbsp;but I saw potential. Thank goodness I had brought along my big 11&#39; longboard, since just about any bump in the water is surfable with this thing. I took my board out for an evening sesh by myself and had a blast. The waves were small, but the sand bar created some fun fast sections. I got in about a solid hour of surf before it got too dark and headed back to the beach. Our first night on the trip and already had 2 fun sessions, I was crossing my fingers it would be a sign of things to come.\n\nDay Two\n\n\n\nI woke up that morning at the crack of dawn and strolled out to the beach to take a look. The surf had gotten smaller, I didn&#39;t even know that was possible. The fun little 2 footers from the evening before were now just ankle high lake size lappers. I watched for a few minutes with the hope of seeing a set roll through, but no such luck. We packed up our gear and started north again, our next stop would be San Luis Obispo a few hours later. When we arrived in Pismo, just a few minutes south of SLO, we found our lack of surf had followed us north and not even so much as a ripple was rolling in. We took a small pit stop at a point break near Shell Beach, this was a wave I frequented while living in SLO back in 2005. Of course it was flat as a lake and covered in a heavy fog.\n\n\n\nSo what do you do when the waves are flat? You hit the bars!&nbsp;Since the crew I was with had never seen SLO I took them into town and got lunch at Firestone&#39;s, one of the best BBQ joints on the central coast. We loaded up on good food and took a stroll around town and stopped at the Creeky Tiki Bar and had a few drinks. Random thing happened, a friend who had just moved from SLO and was passing through while packing happened to see me walking through town. He stopped by the bar and had a few with us before heading down to San Diego.\n\nAfter throwing a few back at the bar we decided to head out towards our camp site for the night. John had reserved us a spot in Morro Bay at a State Park. Since we still had a few hours of sun light left, I convinced the crew to stop at a beach along the way out to Morro, the Sand Spit. When we pulled into the parking lot at the Sand Spit there were a few guys suiting up to go surf. I had a small conversation with one of the guys and he told me a guy just got out of the water and said the waves were &quot;fun&quot;. Seeing as how Pismo was a lake and the walk to the beach is about 1/4 of a mile I didn&#39;t want to suit up and carry my 11&#39; board down on a hunch. We all walked down the trail and over the dunes through the fog, it was something out of a story book. It resembled the landscape from a scene in The Lord of the Rings, I half expected a troop of goblins on horseback to come rushing thru. When we finally made it down to the sand to my surprise there was some fun little 1-2 foot surf.\n\nThe Sand Spit is a large stretch of beach, a few miles long and runs north all the way to Morro Rock. I had surfed it a few times back in 2005, and found this place to be very similar to a sandbar we surfed back home in Hawaii at Waiapio Valley. The beach is steep and allows the swell to roll right up on the sand, making for some very fast and hollow shore break. I ran back to the RV and suited up, John and I surfed for about an hour. The waves were small, but I was stoked to be able to surf, was worried I would get snaked on the trip and not surf every day.\n\nAfter our small session at the Sand Spit we made our way back to Morro, our camp ground was on the edge of the sand just a few hundred yards from the water. I could hear the waves that night, but could tell by the sound it was nothing in size.\n\nDay Three\n\nAgain I woke at the crack of dawn, walked out to the water wrapped in my blanket. The fog was dense and visibility was only about 30-40 yards or so. When I finally got close enough to see the water it was flat, just as small as Ventura was the morning before. I was bummed, another day of small surf. I walked back to camp and jumped back into bed, defeated in the idea the reported swell was going to arrive. Later that morning the crew discussed our options, the plan was to make it to Santa Cruz, but how we would get there was the tricky part.\n\nFrom Morro you can take Highway 1 up through Big Sur, a winding road along the edge of steep cliffs and unreal landscapes. It would be a great drive, but a slow one in an RV. Also there are not&nbsp;many beach access points along the road and surfing would be difficult. Thankfully we decided to just take the 101 north to Santa Cruz so we could spend more time up there. It took us about 4 hours to get into southern Santa Cruz, we stopped at a Mexican food joint to fuel up and figure out our camping situation.\n\nI had found a few camp spots along the coast in the area around Capitola. We stopped at a park that had open spaces and pulled into our spot. The park attendants told us there was a beach access trail so we took a stroll and discussed our options for the day. The surf report said it was 1-2 feet, so surfing seemed like it was less of a priority. Some of the guys on the trip were not so gun-ho about surfing and wanted to go to the bars or just tan on the beach. This did not sound like any sort of fun to me. The trip was starting to come to an end and we had no surf to show for it. While looking for the beach access trail we came upon a bluff that over looked the bay and views north up towards Santa Cruz. The beach below us was flat just as Ventura and Morro had been. Off in the distance to a peak in the north we saw white wash on the coast. This seemed odd to me, since the surf reports all said it was flat. But this white wash on the coast was forming into lines, surfable lines. I could tell by the size and the distance it was not 2 foot as predicted. We started to debate on what to do, the idea of tanning and hitting the bars was still getting tossed around. At this point I was getting frustrated, I could see the waves, just a few miles away and it sounded like we were not going to check it out. After more debate a decision was made to check the surf in passing before heading to the store to pick up supplies. This would prove to be the best decision of the trip.\n\n\n\nWe drove out to an area called Pleasure Point, and found some parking near a surf spot named The Hook. Upon running out to view the surf I asked a local about the size, and his reply was something along the lines of: &quot;Super fun, about head high on sets&quot;. Head high on sets! Holy shit, we have been chasing knee high surf all week. The movie Endless Summer said it best, surfers dream wave while traveling is clean conditions around head high. This spot was just that, a perfect right with consistent 3-4 foot waves and a few random sets hitting around the high 6 foot mark. I was in heaven, and to top it off this swell was not on the map, so not many surfers knew about it. There were only a few guys in the water.\n\nThe local scene was mellow, I chatted it up with a few guys and told them of our trip from San Diego and how stoked we were for these waves. I got a nice set wave and tried my best to get around a wide section, but it was much faster than I expected and kept getting close outs. A few sets even opened up, and one of the local groms got a grab rail tube ride. It was like a dream, first time to Santa Cruz and we get epic surf, I was stoked. The Hook is just south east of Pleasure Point, and from what I could see that wave&nbsp;a sick long right, but crowded. I am sure it is something like Swami&#39;s in Encinitas, great wave but crowded with locals and learners.\n\n\n\nThat night at our camp ground the surf stoke was strong. The idea of bigger surf made for good camp fire chatter. But we were not the only ones up by camp fire light that evening, apparently the raccoon population is high in that area. Our RV was raided for a bag of chips, and the theif would have gotten away with it if he/she didn&#39;t knock items off the counter. The crashing sound was a dead give away, that and the sound of a plastic bag being dragged on pavement. I guess stealth is not always raccoon game plan, sometimes a good smash and grab works too. Later that night while in my tent a raccoon woke me up jumping through the bushes, I didn&#39;t feel super safe with only a small layer of nylon between me and them.\n\nDay Four\n\nSame as before I wake up and walked out to the bluff to check the surf. There was still some whitewash on the coast but it looked smaller. We talked of a dawn session, but since the waves were smaller it seemed best to take our time and have a big breakfast, we would need the energy. We surfed The Hook again, it was smaller but there were still some head high sets. Also the word had spread that the waves were good, the crowd had tripled. This also upped the local vibe, people were snaking waves and dropping in left and right. I was on my 11&#39; board, so I tried not to just jump straight into the pack and slowly ease my way into the lineup. Didn&#39;t seem to work to well because I got dropped in on time and time again. The peak I was surfing the day before has crowded with a group of about 10 guys. I could tell by the way they grouped up they all knew each other. The localism was strong this day.\n\nSince the point looked good and a spot just inside of it had some nice waves we decided to paddle west across the bay to the next peak about 400 yards away. The crowd looked thin from a distance, but upon arrival I found it was dense with longboarders. Most of them were either just learning to surf, or their&nbsp;first day in the water. A few of the guys on the outside were locals so I decided to form up with the local pack and wait for a set. I wish I had a camera to take a picture of the crowd, the right was so dense with longboarders sitting around the inside you couldn&#39;t even pick a line. My first set wave I took off deep behind the right peak, had to hoot off a few people and dodge a few more inside but I somehow managed to catch it all the way to the beach. With the exception of the crowd this was an epic wave. My ride felt like 30 seconds and no close out sections.\n\nAfter a few hours we all got out of the water and got lunch, I was still on a high from the conditions the day before so decided to go back out. The rest of the crew took off on foot to check out the local bar scene. My second session was not less crowded than the first but I kept telling myself how lucky I was to be getting waves like this. It was so surreal, a foreign area and good surf. My imagination could have put me anywhere, the landscape around pleasure point is awesome. Rocky coves and lots of evergreen trees, and the water temp was warmer than down south.\n\nLater that night we decided to start heading back down to San Diego, we needed to drop off the RV that next afternoon and it was still 10 hours of driving ahead of us. We drove down to a rest stop just north of Santa Barbra to rest for the night. Parked on the side of the highway and trying to sleep in the passenger seat was no fun, I kept waking up when big rigs would pass by and shake the RV. At one point in the night John woke up yelling that we were moving, and for a split second I believed him... but it was just the illusion of passing trucks shacking the RV.\n\nDay Five -The Final Day\n\nI was awoken at 6am to the sound of John&#39;s phone alarm and was picked as driver for that morning stretch. I drove us down to Rincon just between Ventura and Santa Barbra, and almost passed the exit but just happened I pulled into it when I stopped to check the map. It was about 6:40am when we pulled into the parking lot, the rest of the crew was still sleeping in their&nbsp;beds. When I arrived there was only one other car in the lot, and while walking down the trail I happened upon the lone surfer heading back to his car after surfing. This guy was a true surf nut, already out of the water by 7am from a morning session, dang I need to be more like that. I really didn&#39;t expect much since the surf was small down south, but when I took a look at Rincon it was perfect... I mean PERFECT 2 foot waves. I got my 11&#39; long board and got out in the water, John and Chris soon joined me.\n\nWords can&#39;t even do this morning justice, the waves looked like mini Indo, just perfect peeling 2 foot barrels down the beach. The waves would just run perpendicular to the sand for yards, just kept rolling thru. It was unreal! To top it off a pod of dolphins stopped by and started playing in the cove, jumping around and making strange squishy noises. I was in surf bliss. But we had to make the session short since we were on a time line to get to San Diego. Plus a few more local long boarders showed up and I didn&#39;t want to steal all there waves. I got a few perfect little rights, tried to duck in and get barreled but it was too small and just drilled my head.\n\n\n\nWe left that perfect session just stoked, I don&#39;t know if the other guys know how good it was. I have been surfing for years and have only seen conditions that clean a few dozen times, we were very lucky that morning.\n\nA long drive ahead of us the stoke slowly wore off, the traffic and driving put reality back in our minds and the trip was soon over. I was a little sad, but also happy to be home. I am sure the guys were glad to be rid of me, since I kept nagging about surfing the whole trip and don&#39;t know if everyone was on my same level of thinking. Regardless of everyone else I had a great time, and this will be a trip I will remember for a long time. It has also sparked a desire to start camping more, something I don&#39;t do enough of these days... was my first camping trip in 3-4 years. On final note, my drive back home thru San Diego gave for a nice surprise, the flat spell had broken and small waves returned to north county. Maybe it is magic, or maybe just dumb luck, whatever it is I want to believe our trip made it happen.\n\n','camping, roadtrip, surfing','1135e21e5c4762e91e0663115ea3316c','blog','blog:post','blog:posts','36','blog/2013/09/rv-road-trippin','admin/blog/edit/36','admin/blog/delete/36'),(57,'Contact Me','',NULL,NULL,'pages','pages:page','pages:pages','3','contact','admin/pages/edit/3','admin/pages/delete/3'),(58,'About Me','',NULL,NULL,'pages','pages:page','pages:pages','5','me','admin/pages/edit/5','admin/pages/delete/5'),(60,'Search','',NULL,NULL,'pages','pages:page','pages:pages','8','search','admin/pages/edit/8','admin/pages/delete/8'),(64,'Search Results','',NULL,NULL,'pages','pages:page','pages:pages','9','search/results','admin/pages/edit/9','admin/pages/delete/9');
