INSERT INTO `emeehan_secretspotsurf_sessions` VALUES (1,'2013-06-12 04:27:47','2013-06-12 20:28:23',1,1,1370970000,2,1,'10','Was an eppic session. Watched from the beach for 15min, seen some small waves but it looked okay... started to paddle out and got a glimpse of my first set. It was about shulder high and super clean peeling tubes on the reef. Some open enough to get into. When I paddled out there were only 3 guys out. Got super fun wave after wave, the tide was middle about 2.3ft and rising. My last wave was all time, 4-5 ft face, front side right off the back peak, my bottom turn felt odd, was hard on the tail. Got off my bottom turn and tucked into the little pocket and got a little barrel, but not deep. Pumped up to the top and did a clean cutback on the connected wedge. Got off a few small turns, was all time, and rode it in all the way up to the sand on my belly.\n<h3>Solspot report:</h3>\n\n<p a=\"\" dominant=\"\" feet=\"\" font-family:=\"\" font-size:=\"\" li=\"\" line-height:=\"\" margin:=\"\" med-period=\"\" ssw=\"\" with=\"\"><strong>Primary Swell:</strong></p>\n\n<ul>\n <li font-family:=\"\" font-size:=\"\" letter-spacing:=\"\" line-height:=\"\" margin:=\"\" span=\"\">2.3ft 14.3 seconds 203 degrees (SSW)</li>\n</ul>\n<strong>Secondary Swell:</strong>\n\n<ul>\n <li font-family:=\"\" font-size:=\"\" letter-spacing:=\"\" line-height:=\"\" margin:=\"\" span=\"\">2ft 9.9 seconds 248 degrees (WSW)</li>\n</ul>\n','dummy',2),(2,'2013-06-13 05:37:12','2013-06-29 23:15:20',1,2,1371060000,2,1,'7','Super fun day, seems the conditons are good here on a calm wind and +3ft tide and rising. Size was about shoulder to almost head high on a few sets. Wide steep walls on the reef. Was very shallow on the inside, about 2-3 feet.<br />\n<br />\n<strong>Primary Swell:</strong>\n<ul>\n <li>2.6ft 13.3 seconds 203 degrees (SSW)</li>\n</ul>\n<strong>Secondary Swell:</strong>\n\n<div>\n<ul>\n <li>&lt;span 1.6em;&quot;=&quot;&quot;&gt;2ft 9.1 seconds 293 degrees (WNW)</li>\n</ul>\n</div>\n','f71ec98450f938e',2),(3,'2013-06-14 07:59:41',NULL,1,3,1371148200,2,1,'5','<div  rgb(0, 0, 0); font-family: OpenSans-CondBold, Helvetica, Arial, sans-serif; font-size: 13px; line-height: normal; margin-left: 25px; margin-top: 5px;\">Got a late session in today after a full day of work. Smaller then the last few days but still some random shoulder high sets. The tide was about +2.5 and dropping. Some of the sets would suck pretty low, I touched the reef with my hand on one wipe out. Was trying to shot the south reef section again, the dropping tide caused more wrap today. Had one good little drop and jumped out to the shoulder after a bad bottom turn. Scored a nice section later over the reef, and got the wedge reform for a few small turns... but over all a slow wave today.<br />\n<br />\n<br />\n<strong>Primary Swell:</strong>\n<ul>\n <li  0px; font-family: Arial, Helvetica, sans-serif; font-size: 10pt; letter-spacing: 0px;\">2ft 9.9 seconds 293 degrees (WNW)</li>\n</ul>\n<strong>Secondary Swell:</strong>\n\n<ul>\n <li  0px; font-family: Arial, Helvetica, sans-serif; font-size: 10pt; letter-spacing: 0px;\">2.6ft 10.5 seconds 248 degrees (WSW)</li>\n</ul>\n</div>','97cf53e623bb213',1),(4,'2013-06-22 22:25:32','2013-06-22 22:25:57',1,4,1371308400,2,4,'5','Alika was in town. We surfed a few small sessions, conditions were great but waves were small.','dummy',2),(5,'2013-06-22 22:27:08',NULL,1,5,1371391200,2,4,'5','Another beach day with Alika and family. Was smaller this day.','dummy',2),(6,'2013-06-22 22:28:40',NULL,1,6,1371657600,2,1,'6','Fun day, super high tide so the sections had fun drops but the shoulder lost all speed.','dummy',2),(7,'2013-06-22 22:30:48','2013-06-29 23:10:03',1,7,1371714300,1,1,'6','Tide was high, some fun sets rolled in, but got better as the tide dropped. There were 3 SUP guys in the water that started to piss me off. One of them tried to burn me on a wave, and then later boxed out some woman on a longboard. Pretty dick move.','1898efcaf350221',2),(8,'2013-06-22 22:32:02',NULL,1,8,1371733200,1,1,'7','Surfed the north peak at Beacons with John on his new board. Had a few really fun rights, racing the section and got off a few little turns off the top.','dummy',2),(9,'2013-06-29 23:00:43',NULL,1,9,1372330800,1,3,'6','The waves were fun, but have not rode the 7&#39;2&quot; in a long time. The rails feel sloppy and I was really haveing a hard time moving it on those waves. I did get a few nice backside waves, even got off the top on one and rode out a little section. Was surfing about 100 yards south of the south reef. Inside sand bar was fun on the high tide.','dummy',3),(10,'2013-06-29 23:13:07',NULL,1,10,1372431600,1,1,'6','Surfed along the south sandbar again today. Forgot my leash so got to practice my leashless board grabs. There were still some fun sets, had a few really good rights. My last wave was about head heigh, and got a little close out barrel.&nbsp;','01e005741b42262',2),(11,'2013-06-30 06:15:30','2013-06-30 06:16:49',1,11,1372525200,1,5,'7','I took the GoPro out today, got some okay waves. Was small again but fun. I surfed the southern sandbar again. I have a nickname for this place now. I call it Alcatraz because of the concrete columns on the beach. From now on I will call it north and south Alcatraz. It is a fun little wave. I also got one of my backside cut backs on video this time. I really need to crank it on the return from the white wash.','dummy',3),(12,'2013-07-12 16:30:19',NULL,1,12,1372604400,1,1,'5','The swell popped up quick, very stormy and lots of current. Was going to take Ali out that day to teach her but conditions were not good. The waves were fun but a little intense with all the movement and crowd.','dummy',1),(13,'2013-07-17 19:56:52',NULL,1,13,1373731200,1,4,'4','I took Ali to the beach this day, the waves were small but the inside shorebreak was a little rough for her. I caught a few fun waves but nothing to crazy. Was a normal summer surf session.','dummy',2),(14,'2013-07-17 20:00:20',NULL,1,14,1373817600,1,4,'6','Went on a solo long boarding session, the waves were fun and had a good time. I went leashed this time, the line up was crowded and I just wanted to try some new stuff. I was able to get off a few little floaters with the longboard, even did a cut back and tried to reconnect with the section but got a little squirly. Was a fun session, really tried to be more aggresive this time and it really worked out well.','dummy',3),(15,'2013-08-01 00:08:35',NULL,1,15,1374415200,5,1,'4','Waves were sizeable but had no power. Was surfing with Alika and Minne, had some fun shore breaks... almost got tubed.','dummy',1),(16,'2013-08-01 00:10:38',NULL,1,16,1374778800,4,1,'6','I trunked it before checking the water temp, was pretty cold. The waves were okay size, some sets but nothing special.','dummy',2),(17,'2013-08-01 00:11:56',NULL,1,17,1374822000,4,1,'7','The conditions were good, but the waves dropped down a little. Was all by myself for at least an hour. It got crappy as the tide got higher.','dummy',2),(18,'2013-08-01 00:13:41',NULL,1,18,1374861600,2,1,'6','Tide was super low, almost critical on sets. Some random scramblers but was fun over all.','dummy',1),(19,'2013-08-01 00:15:55',NULL,1,19,1374933600,2,1,'3','Waves got really small, not much swell to get and the tide was low and on the rise. Over all a crappy session. Got to surf with Alika, to bad he didn&#39;t bring any Hawaii waves with him.','dummy',3),(20,'2013-08-01 00:17:23',NULL,1,20,1375020000,2,4,'5','Waves were still small but had fun on the long board. Lots of SUPers in the water, started to piss me off a little. Got Ali on the long board to surf the inside rollers, think she is getting to her feet faster now.','dummy',3),(21,'2013-08-13 05:59:49','2013-08-13 06:03:14',1,21,1376139600,6,4,'6','Surfed a new spot with Jay in Del Mar, never been to this reef before.','dummy',2);
