INSERT INTO `emeehan_secretspotsurf_spots` VALUES (1,'2013-06-08 04:44:02',NULL,1,1,'6','Beacons',NULL,'dummy',NULL,NULL),(2,'2013-06-08 04:44:30',NULL,1,2,'8','Table Tops',NULL,'dummy',NULL,NULL),(3,'2013-06-08 04:44:53',NULL,1,3,'6','Stone Steps',NULL,'dummy',NULL,NULL),(4,'2013-08-01 00:04:31',NULL,1,4,'8','Seaside Reef','Located in Solana Beach, this is one of the only outer reefs in the area. Breaks on a good low tide.','dummy',NULL,NULL),(5,'2013-08-01 00:05:35',NULL,1,5,'5','Grandeview','Beach break, can get good shore break.','dummy',NULL,NULL),(6,'2013-08-13 06:02:32',NULL,1,6,'5','Del Mar - 6th Street',NULL,'dummy',NULL,NULL);
